8975dcf5d7a'),(370,150,4,'Example 3',NULL,NULL,'{\"210d9fa3-32b0-47ac-a970-3859d419f4c1\": \"tbd.\", \"f7c71e3b-41bf-46f6-920c-4605371cc48e\": \"tbd.\"}',1,'2023-11-20 09:57:48','2023-11-20 09:57:48','6f4f74af-d2ca-4e12-9b3b-5fcb4ec2a202'),(373,152,3,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"Nestled along the banks of the Elbe River in northern Germany, Hamburg stands as a vibrant and historic metropolis, beckoning visitors with its rich maritime heritage and contemporary urban allure. As the country\'s second-largest city and its principal port, Hamburg has long been a pivotal economic and cultural hub. The cityscape is defined by an eclectic mix of architectural styles, from the medieval charm of the Speicherstadt, the world\'s largest warehouse complex, to the sleek modernity of the HafenCity district, showcasing the dynamic evolution of Hamburg over the centuries. The bustling port activities contribute to the city\'s cosmopolitan atmosphere, attracting a diverse population and fostering a global perspective that is evident in its lively cultural scene and gastronomic offerings.\\n\\nHamburg\'s cultural tapestry is woven with an array of museums, theaters, and music venues, making it a haven for art enthusiasts and music lovers alike. The iconic Elbphilharmonie, a modern masterpiece perched atop an old warehouse, stands as a testament to the city\'s commitment to blending tradition with innovation. Beyond its cultural richness, Hamburg\'s green spaces, such as the expansive Planten un Blomen park and the picturesque Alster Lake, provide residents and visitors alike with tranquil retreats within the heart of this dynamic urban landscape. Whether exploring historic landmarks, savoring local delicacies in the bustling markets, or cruising along the picturesque canals, Hamburg beckons with a unique blend of old-world charm and contemporary vibrancy.\"}',1,'2023-11-20 09:57:59','2023-11-20 09:57:59','43204196-5d05-44d6-a9f4-a62b1897e8ca'),(374,152,4,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"An den Ufern der Elbe in Norddeutschland gelegen, ist Hamburg eine pulsierende und historische Metropole, die Besucher mit ihrem reichen maritimen Erbe und ihrem modernen urbanen Charme anzieht. Als zweitgrößte Stadt des Landes und wichtigster Hafen ist Hamburg seit langem ein wichtiger wirtschaftlicher und kultureller Knotenpunkt. Das Stadtbild wird von einem eklektischen Mix aus verschiedenen architektonischen Stilen geprägt, vom mittelalterlichen Charme der Speicherstadt, dem größten Lagerhauskomplex der Welt, bis hin zur eleganten Modernität der HafenCity, die die dynamische Entwicklung Hamburgs im Laufe der Jahrhunderte widerspiegelt. Die geschäftigen Hafenaktivitäten tragen zur kosmopolitischen Atmosphäre der Stadt bei, die eine vielfältige Bevölkerung anzieht und eine globale Perspektive fördert, die sich in der lebendigen Kulturszene und dem gastronomischen Angebot widerspiegelt.\\n\\nHamburgs kultureller Teppich ist mit einer Vielzahl von Museen, Theatern und Musikveranstaltungen gespickt, was die Stadt zu einem Paradies für Kunst- und Musikliebhaber macht. Die ikonische Elbphilharmonie, ein modernes Meisterwerk, das auf einem alten Lagerhaus thront, ist ein Zeugnis für das Engagement der Stadt, Tradition und Innovation zu verbinden. Neben dem kulturellen Reichtum bieten Hamburgs Grünflächen, wie der weitläufige Park Planten un Blomen und die malerische Alster, Einwohnern und Besuchern gleichermaßen ruhige Rückzugsorte inmitten dieser dynamischen Stadtlandschaft. Ob bei der Erkundung historischer Wahrzeichen, beim Genuss lokaler Köstlichkeiten auf den belebten Märkten oder bei einer Schifffahrt auf den malerischen Kanälen - Hamburg lockt mit einer einzigartigen Mischung aus altem Charme und moderner Lebendigkeit.\"}',1,'2023-11-20 09:57:59','2023-11-20 09:57:59','f7b7061d-d1aa-472a-96f8-7b76c96115f0'),(463,23,5,'Example 59',NULL,NULL,'{\"210d9fa3-32b0-47ac-a970-3859d419f4c1\": \"tbd.\", \"f7c71e3b-41bf-46f6-920c-4605371cc48e\": \"tbd.\"}',1,'2023-11-20 10:24:47','2023-11-20 10:24:47','90851689-f7a0-4dd2-95fe-0b98ededb1bc'),(465,25,5,'Example 61',NULL,NULL,'{\"210d9fa3-32b0-47ac-a970-3859d419f4c1\": \"tbd.\", \"f7c71e3b-41bf-46f6-920c-4605371cc48e\": \"tbd.\"}',1,'2023-11-20 10:24:47','2023-11-20 10:24:47','d9e57818-a2c9-4243-9820-703104d8cc01'),(467,31,5,'Example 10',NULL,NULL,'{\"210d9fa3-32b0-47ac-a970-3859d419f4c1\": \"tbd.\", \"f7c71e3b-41bf-46f6-920c-4605371cc48e\": \"tbd.\"}',1,'2023-11-20 10:24:47','2023-11-20 10:24:47','3876840e-00d5-4bac-8733-022191753136'),(468,104,5,'Example 12',NULL,NULL,'{\"210d9fa3-32b0-47ac-a970-3859d419f4c1\": \"tbd.\", \"f7c71e3b-41bf-46f6-920c-4605371cc48e\": \"tbd.\"}',1,'2023-11-20 10:24:47','2023-11-20 10:24:47','f8c3bd23-3551-4964-a589-bc33701c9b48'),(471,140,5,'Example 8',NULL,NULL,'{\"210d9fa3-32b0-47ac-a970-3859d419f4c1\": \"tbd.\", \"f7c71e3b-41bf-46f6-920c-4605371cc48e\": \"tbd.\"}',1,'2023-11-20 10:24:47','2023-11-20 10:24:47','e6ea67b5-54dd-4fd9-910b-d42cc140c543'),(472,150,5,'Example 3',NULL,NULL,'{\"210d9fa3-32b0-47ac-a970-3859d419f4c1\": \"tbd.\", \"f7c71e3b-41bf-46f6-920c-4605371cc48e\": \"tbd.\"}',1,'2023-11-20 10:24:47','2023-11-20 10:24:47','fdbd0e0f-4275-4c48-ab67-72a721407a32'),(473,4,5,'Startseite','home','__home__','{\"c1940a37-f8d1-4445-a880-101255bfabe5\": \"Ihr Dorfmagazin für Soltau\"}',1,'2023-11-20 10:25:03','2023-11-20 10:25:03','a72915be-d858-4b02-a6a6-dea35c609827'),(494,1,5,'Site Info - Global Settings','site-info-global-settings',NULL,'{\"0b7b855c-3f2f-4d39-8ef0-e5fccd7a2685\": \"CityMag\", \"c544e80e-5800-4486-82be-1c01d88af25f\": false, \"c5b5269f-b571-4e25-af4c-6cdfdc2fbf56\": \"Perlen vor die Säue GmbH\"}',1,'2023-11-20 10:25:11','2023-11-20 10:25:11','1ef0d25c-e9b6-4861-bccd-30395f9461c9'),(512,139,5,'Unser Magazin','unser-magazin','unser-magazin','{\"bd99bd78-f4c9-4e15-83ca-230c2479d384\": false, \"c05ea8a3-0b6b-41f7-87be-c356ee495284\": \"In der Heide 1\\n\\nSoltau\"}',1,'2023-11-20 10:25:29','2023-11-20 11:23:01','4d0d6d5d-ecbc-41de-bd07-6a094343223a'),(513,142,5,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"🎉 Willkommen in der lebendigen Mischung aus Kultur, Innovation und Geschichte, die das Herzstück unseres Stadtmagazins bildet und die Essenz von bemerkenswerten deutschen Reisezielen einfängt.\\n\\n🏙️ __Berlin - Wo Geschichte auf Moderne trifft:__\\n\\nTauchen Sie ein in die dynamische Energie Berlins, wo an jeder Straßenecke Geschichten aus einer reichen Vergangenheit erzählt werden. Vom ikonischen Brandenburger Tor bis zur eklektischen Straßenkunst der East Side Gallery - Berlin ist eine Stadt, die mühelos Geschichte mit avantgardistischer Kreativität verbindet. Entdecken Sie verborgene Juwelen, erkunden Sie verschiedene Stadtteile und genießen Sie die Mischung aus Tradition und Innovation, die Berlin zu einem kulturellen Kaleidoskop macht.\\n\\n🍻 __München - Bayerische Eleganz und Oktoberfeststimmung:__\\n\\nTauchen Sie ein in das reiche Bild Münchens, einer Stadt, die mühelos bayerische Tradition mit modernem Charme verbindet. Schlendern Sie durch die charmanten Straßen, die mit architektonischen Schmuckstücken wie dem prachtvollen Schloss Nymphenburg und den ikonischen Türmen der Frauenkirche geschmückt sind. Die pulsierende Kulturszene Münchens lädt zu einem Besuch der Museen von Weltrang ein, während die lebhaften Biergärten und traditionellen Brauereien dazu einladen, sich dem herzerwärmenden Geist des Oktoberfestes hinzugeben. Ob Sie sich von der klassischen Eleganz der Residenz verzaubern lassen oder sich von der heiteren Atmosphäre des Viktualienmarktes mitreißen lassen, München ist ein Zeugnis für das harmonische Nebeneinander von Geschichte, Kultur und Lebensfreude. Begleiten Sie uns auf eine Reise durch diese bayerische Metropole, in der jeder Moment eine reizvolle Mischung aus Raffinesse und Lebensfreude ist. 🥨\\n\\n🌊 __Hamburg - Der Hafen der unbegrenzten Möglichkeiten:__\\n\\nSetzen Sie die Segel in Richtung Hamburg, eine Stadt, die ihren maritimen Geist mit offenen Armen empfängt. Entdecken Sie die Faszination der Elbphilharmonie, schlendern Sie entlang der belebten Uferpromenade der Speicherstadt und tauchen Sie ein in die pulsierenden Stadtteile, die Hamburgs kosmopolitischen Charme widerspiegeln. Unser Magazin ist Ihr Kompass, um durch die maritimen Geschichten, die gastronomischen Genüsse und die sich ständig verändernde Kulturlandschaft der Hansestadt zu navigieren.\\n\\n🌳 __Soltau - Naturparadies in der Heide:__\\n\\nEntfliehen Sie in die ruhige Umarmung von Soltau, wo die Natur die Hauptrolle spielt. Erkunden Sie die zauberhaften Landschaften der Lüneburger Heide, entspannen Sie sich im üppigen Grün der Soltauer Heide und genießen Sie die einfachen Freuden des Lebens. Unser Magazin lädt Sie ein, die versteckten Schätze, die Abenteuer in der Natur und die ruhige Schönheit zu entdecken, die Soltau zu einem Rückzugsort für alle machen, die sich in die Natur zurückziehen möchten.\\n\\n\\n📖 Auf unseren Seiten finden Sie eine kuratierte Sammlung von Geschichten, Features und Einblicken, die den Geist dieser Städte widerspiegeln. Egal, ob Sie Einwohner oder neugieriger Besucher sind, begleiten Sie uns auf eine Reise durch die vielfältigen Facetten der Städte. Willkommen an Bord, wenn wir den Puls dieser unglaublichen Reiseziele erforschen, feiern und aufdecken! 🌍📸 \\n\\n\\\\#CityVibesMagazine #DiscoverBerlinHamburgSoltau\"}',1,'2023-11-20 10:25:29','2024-03-26 11:00:23','f530c65d-ac26-48f5-993d-3dd2d0a6ca20'),(556,185,5,'In der Heide','in-der-heide','artikel/in-der-heide','{\"af872e03-1253-4002-8d19-6dae768135a3\": false}',1,'2023-11-20 10:28:26','2023-11-24 12:34:47','ad40080a-2b1f-45a9-a30c-864dabf04942'),(557,186,1,'Example 10',NULL,NULL,'{\"210d9fa3-32b0-47ac-a970-3859d419f4c1\": \"tbd.\", \"f7c71e3b-41bf-46f6-920c-4605371cc48e\": \"tbd.\"}',1,'2023-11-20 10:28:43','2023-11-20 10:28:43','a487c778-232b-4e5a-ae9e-b4daf6bd658e'),(558,186,2,'Example 10',NULL,NULL,'{\