s forms. The city\'s theaters and concert halls, including the renowned National Theatre and the Gasteig, showcase performances that range from classical masterpieces to avant-garde productions.\"}',1,'2023-11-23 23:37:41','2023-11-23 23:37:41','2196a7a9-d1a7-4e64-8e0c-c36c7a6b1a2a'),(2338,584,7,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"Im Herzen Bayerns gelegen, ist München ein kulturelles Juwel, das jahrhundertealte Traditionen nahtlos mit einer modernen Lebendigkeit verbindet, die Einheimische und Besucher gleichermaßen in ihren Bann zieht. Von der ikonischen Architektur bis hin zu den lebhaften Biergärten bietet München eine einzigartige Mischung aus Geschichte, Kultur und festlicher Ausgelassenheit.\\n\\nMünchens Skyline ist ein Zeugnis seiner reichen Geschichte und seines Engagements für die Bewahrung des architektonischen Erbes. Das prächtige Schloss Nymphenburg mit seinen Rokokofassaden und üppigen Gärten versetzt die Besucher in die Zeit der bayerischen Könige. Die hoch aufragenden Türme der Frauenkirche dominieren das Stadtbild und symbolisieren sowohl Glauben als auch Widerstandskraft. Schlendern Sie durch die charmanten Straßen der Stadt, wo jede Ecke eine Geschichte von bayerischer Eleganz und Pracht erzählt.\\n\\nMünchen hat eine Kulturszene, die sich mit den besten Europas messen kann. Kunstliebhaber können sich in der Alten Pinakothek verlieren, die Meisterwerke von Albrecht Dürer und Rembrandt beherbergt. Die Pinakothek der Moderne hingegen widmet sich der zeitgenössischen Kunst in all ihren Formen. Die Theater und Konzerthäuser der Stadt, darunter das renommierte Nationaltheater und der Gasteig, zeigen Aufführungen, die von klassischen Meisterwerken bis hin zu Avantgarde-Produktionen reichen.\"}',1,'2023-11-23 23:37:41','2023-11-23 23:37:41','0cf3290b-9c7c-4e81-8908-a3006874561b'),(2339,584,9,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"Situata nel cuore della Baviera, Monaco di Baviera è un gioiello culturale che intreccia perfettamente tradizioni secolari con una vivacità contemporanea che affascina sia gli abitanti che i visitatori. Dalla sua architettura iconica alle vivaci birrerie all\'aperto, Monaco offre una miscela unica di storia, cultura e festa.\\n\\nLo skyline di Monaco di Baviera è una testimonianza della sua ricca storia e del suo impegno nel preservare il patrimonio architettonico. Lo splendido Palazzo di Nymphenburg, con le sue facciate rococò e i suoi giardini lussureggianti, trasporta i visitatori in un\'epoca di regalità bavarese. Le guglie svettanti della Frauenkirche dominano il paesaggio urbano, simboleggiando sia la fede che la resistenza. Passeggiate per le affascinanti strade della città, dove ogni angolo racconta una storia di eleganza e grandezza bavarese.\\n\\nMonaco vanta una scena culturale che rivaleggia con le migliori d\'Europa. Gli appassionati d\'arte possono perdersi nella Alte Pinakothek, che ospita capolavori di Albrecht Dürer e Rembrandt. La Pinakothek der Moderne, invece, abbraccia l\'arte contemporanea in tutte le sue forme. I teatri e le sale da concerto della città, tra cui il rinomato Teatro Nazionale e il Gasteig, ospitano spettacoli che spaziano dai capolavori classici alle produzioni d\'avanguardia.\"}',1,'2023-11-23 23:37:41','2023-11-23 23:37:41','c00f57ce-c863-4a79-a0c9-13dd46491d28'),(2372,594,6,'Frauenkriche Muenchen Alpen 1920x9601',NULL,NULL,'{\"210d9fa3-32b0-47ac-a970-3859d419f4c1\": \"tbd.\", \"f7c71e3b-41bf-46f6-920c-4605371cc48e\": \"tbd.\"}',1,'2023-11-23 23:52:19','2023-11-23 23:52:19','68242950-bdc7-4d01-a8de-b3ffb79536da'),(2373,594,2,'Frauenkriche Muenchen Alpen 1920x9601',NULL,NULL,'{\"210d9fa3-32b0-47ac-a970-3859d419f4c1\": \"tbd.\", \"f7c71e3b-41bf-46f6-920c-4605371cc48e\": \"tbd.\"}',1,'2023-11-23 23:52:19','2023-11-23 23:52:19','d244d014-6870-40e6-9673-5aa638d780e1'),(2374,594,1,'Frauenkriche Muenchen Alpen 1920x9601',NULL,NULL,'{\"210d9fa3-32b0-47ac-a970-3859d419f4c1\": \"tbd.\", \"f7c71e3b-41bf-46f6-920c-