0 1280',NULL,NULL,'{\"210d9fa3-32b0-47ac-a970-3859d419f4c1\": \"tbd.\", \"f7c71e3b-41bf-46f6-920c-4605371cc48e\": \"tbd.\"}',1,'2023-11-24 11:38:21','2023-11-24 11:38:21','55d93aa4-e332-48f4-9e28-afebcc088769'),(2522,620,2,'Berlin erkunden: Eine Symphonie aus Geschichte und Moderne','berlin-erkunden-eine-symphonie-aus-geschichte-und-moderne','artikel/berlin-erkunden-eine-symphonie-aus-geschichte-und-moderne','{\"af872e03-1253-4002-8d19-6dae768135a3\": true}',1,'2023-11-25 12:25:00','2023-11-25 12:26:22','6b0c2e5c-37af-4af8-954f-678156cb12ba'),(2523,620,1,'Exploring Berlin: A Symphony of History and Modernity','exploring-berlin-a-symphony-of-history-and-modernity','articles/exploring-berlin-a-symphony-of-history-and-modernity','{\"af872e03-1253-4002-8d19-6dae768135a3\": true}',1,'2023-11-25 12:25:00','2023-11-25 12:26:14','5de9ecc5-374a-4eb0-a665-1eceae9d9194'),(2530,624,2,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"Berlin, die pulsierende Hauptstadt Deutschlands, verbindet mühelos eine reiche Geschichte mit einer modernen, dynamischen Energie, die jeden Reisenden, der das Glück hat, durch ihre Straßen zu wandern, in ihren Bann zieht. Nach einer turbulenten Vergangenheit hat sich Berlin zu einer Stadt entwickelt, die Widerstandsfähigkeit, Vielfalt und Kreativität zelebriert. Von historischen Wahrzeichen bis hin zu pulsierenden Szenevierteln ist Berlin ein fesselndes Reiseziel, das eine unvergessliche Reise verspricht.\\n\\nBeginnen Sie Ihre Erkundungstour am Brandenburger Tor, dem Wahrzeichen der deutschen Wiedervereinigung. Dieses majestätische neoklassizistische Monument steht stolz im Herzen der Stadt und bildet das Tor zu Unter den Linden, einem historischen Boulevard, der von Museen, Palästen und charmanten Cafés gesäumt ist. Schlendern Sie zu verschiedenen Tageszeiten durch das Brandenburger Tor und erleben Sie seine verwandelnde Schönheit - im warmen Licht des Sonnenaufgangs oder im Licht des Nachthimmels erweckt es immer wieder ein Gefühl der Ehrfurcht.\\n\\nTauchen Sie in die komplexe Geschichte Berlins ein, indem Sie die East Side Gallery besuchen, einen lebendigen Abschnitt der Berliner Mauer, der mit über hundert Wandmalereien von Künstlern aus aller Welt geschmückt ist. Jedes Wandbild erzählt eine eigene Geschichte und spiegelt die Hoffnung, die Kämpfe und die Triumphe einer Stadt wider, die einst geteilt war. Bei einem Spaziergang durch diese Open-Air-Galerie werden Sie das Echo der Vergangenheit und den unverwüstlichen Geist spüren, der Berlin heute prägt.\"}',1,'2023-11-25 12:25:31','2023-11-25 12:25:31','1cc1ef47-d81f-4601-89d7-f91ba62ecad0'),(2531,624,1,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"Berlin, the vibrant capital of Germany, effortlessly blends a rich tapestry of history with a modern, dynamic energy that captivates every traveler lucky enough to wander its streets. Steeped in a tumultuous past, Berlin has emerged as a city that celebrates resilience, diversity, and creativity. From iconic historical landmarks to trendy neighborhoods pulsating with life, Berlin is a captivating destination that promises an unforgettable journey.\\n\\nBegin your exploration at the iconic Brandenburg Gate, an enduring symbol of German reunification. This majestic neoclassical monument stands proudly at the heart of the city, providing a gateway to Unter den Linden, a historic boulevard lined with museums, palaces, and charming cafes. Wander through the Brandenburg Gate at different times of the day to witness its transformative beauty – bathed in the warm glow of sunrise or illuminated against the night sky, it never fails to evoke a sense of awe.\\n\\nDelve into Berlin\'s complex history with a visit to the East Side Gallery, a vibrant stretch of the Berlin Wall adorned with over a hundred murals by artists from around the world. Each mural tells a unique story, reflecting the hope, struggles, and triumphs of a city that once stood divided. As you stroll along this open-air gallery, you\'ll feel the echoes of the past and the resilient spirit that now defines Berlin.\"}',1,'2023-11-25 12:25:31','2023-11-25 12:25:31','dc575482-b772-4092-95cc-dbc0f033a251'),(2532,625,6,'Blue hour 3848856 1280',NULL,NULL,'{\"210d9fa3-32b0-47ac-a970-3859d419f4c1\": \"tbd.\", \"f7c71e3b-41bf-46f6-920c-4605371cc48e\": \"tbd.\"}',1,'2023-11-25 12:26:47','2023-11-25 12:26:47','4fb66819-1660-4a33-b55d-a35a02fe726c'),(2533,625,2,'Blue hour 3848856 1280',NULL,NULL,'{\"210d9fa3-32b0-47ac-a970-3859d419f4c1\": \"tbd.\", \"f7c71e3b-41bf-46f6-920c-4605371cc48e\": \"tbd.\"}',1,'2023-11-25 12:26:47','2023-11-25 12:26:47','f360f1a2-dd8f-41af-b968-100e6854196a'),(2534,625,1,'Blue hour 3848856 1280',NULL,NULL,'{\"210d9fa3-32b0-47ac-a970-3859d419f4c1\": \"tbd.\", \"f7c71e3b-41bf-46f6-920c-4605371cc48e\": \"tbd.\"}',1,'2023-11-25 12:26:47','2023-11-25 12:26:47','45a6786c-65e2-45b5-a325-c8c6d5be876d'),(2535,625,4,'Blue hour 3848856 1280',NULL,NULL,'{\"210d9fa3-32b0-47ac-a970-3859d419f4c1\": \"tbd.\", \"f7c71e3b-41bf-46f6-920c-4605371cc48e\": \"tbd.\"}',1,'2023-11-25 12:26:47','2023-11-25 12:26:47','a2897c41-2b82-45c9-a8cb-9f4d8f11db5b'),(2536,625,3,'Blue hour 3848856 1280',NULL,NULL,'{\"210d9fa3-32b0-47ac-a970-3859d419f4c1\": \"tbd.\", \"f7c71e3b-41bf-46f6-920c-4605371cc48e\": \"tbd.\"}',1,'2023-11-25 12:26:47','2023-11-25 12:26:47','9e2c3809-a954-4e7f-a303-76d2b5afe4e4'),(2537,625,7,'Blue hour 3848856 1280',NULL,NULL,'{\"210d9fa3-32b0-47ac-a970-3859d419f4c1\": \"tbd.\", \"f7c71e3b-41bf-46f6-920c-4605371cc48e\": \"tbd.\"}',1,'2023-11-25 12:26:47','2023-11-25 12:26:47','9da3ce92-cd58-4bc4-a858-cea072c498a3'),(2538,625,8,'Blue hour 3848856 1280',NULL,NULL,'{\"210d9fa3-32b0-47ac-a970-3859d419f4c1\": \"tbd.\", \"f7c71e3b-41bf-46f6-920c-4605371cc48e\": \"tbd.\"}',1,'2023-11-25 12:26:47','2023-11-25 12:26:47','071bc316-da7e-422c-b8c0-98bac603eb2b'),(2539,625,9,'Blue hour 3848856 1280',NULL,NULL,'{\"210d9fa3-32b0-47ac-a970-3859d419f4c1\": \"tbd.\", \"f7c71e3b-41bf-46f6-920c-4605371cc48e\": \