tierten Gegenwart zu verbinden.\\n\\nAm Abend können Sie das legendäre Berliner Nachtleben genießen. Von Techno-Tempeln wie dem Berghain bis hin zu intimen Jazzclubs und historischen Biergärten erwacht die Stadt nach Einbruch der Dunkelheit zum Leben. Tauchen Sie ein in die pulsierenden Beats der elektronischen Musikszene oder entspannen Sie sich in einer gemütlichen Bar mit einem Craft Beer in der Hand - das Berliner Nachtleben bietet für jeden Geschmack etwas.\\n\\nBerlin, mit seiner Dichotomie aus Geschichte und Moderne, verspricht eine einzigartige und bereichernde Reiseerfahrung. Ganz gleich, ob Sie von den ikonischen Wahrzeichen der Stadt fasziniert sind, sich für ihre komplexe Geschichte interessieren oder sich von ihrem modernen Charme verzaubern lassen - Berlin lädt Sie ein, eine Stadt zu erkunden, die sich ihrer Vergangenheit stellt und gleichzeitig die Zukunft mit offenen Armen empfängt.\"}',1,'2023-11-26 12:40:42','2023-11-26 12:40:42','07164bfb-d937-4ede-aa8b-b1736faaf37c'),(2847,698,1,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"For a taste of the city\'s modern vibrancy, head to Kreuzberg. This eclectic neighborhood is a melting pot of cultures, boasting a diverse culinary scene, trendy boutiques, and a thriving arts community. Explore Görlitzer Park, where locals gather to enjoy picnics and live music, or lose yourself in the vibrant street art that adorns every corner. Kreuzberg is a testament to Berlin\'s ability to seamlessly blend its storied past with a progressive, forward-thinking present.\\n\\nIn the evening, savor Berlin\'s legendary nightlife. From techno temples like Berghain to intimate jazz clubs and historic beer gardens, the city comes alive after dark. Immerse yourself in the pulsating beats of the electronic music scene or unwind in a cozy bar with a craft beer in hand – Berlin\'s nightlife caters to every taste.\\n\\nBerlin, with its dichotomy of history and modernity, promises a unique and enriching travel experience. Whether you\'re captivated by its iconic landmarks, intrigued by its complex history, or enchanted by its contemporary charm, Berlin invites you to explore a city that has embraced its past while embracing the future with open arms.\"}',1,'2023-11-26 12:40:42','2023-11-26 12:40:42','c4d05f27-aec5-4cad-95a4-846c7d4314d2'),(2912,728,6,'Munich 3909108 1280',NULL,NULL,'{\"210d9fa3-32b0-47ac-a970-3859d419f4c1\": \"tbd.\", \"f7c71e3b-41bf-46f6-920c-4605371cc48e\": \"Pixabay\"}',1,'2023-11-26 12:45:48','2023-11-26 12:45:48','afb6f4c3-428e-4198-9211-3d4662630c5e'),(2913,728,2,'Munich 3909108 1280',NULL,NULL,'{\"210d9fa3-32b0-47ac-a970-3859d419f4c1\": \"tbd.\", \"f7c71e3b-41bf-46f6-920c-4605371cc48e\": \"Pixabay\"}',1,'2023-11-26 12:45:48','2023-11-26 12:45:48','346f83fa-a6b7-4bbf-af65-70d5641ebf87'),(2914,728,1,'Munich 3909108 1280',NULL,NULL,'{\"210d9fa3-32b0-47ac-a970-3859d419f4c1\": \"tbd.\", \"f7c71e3b-41bf-46f6-920c-4605371cc48e\": \"Pixabay\"}',1,'2023-11-26 12:45:48','2023-11-26 12:45:48','3c285b3c-d312-43a4-a71e-83029fa1df2c'),(2915,728,4,'Munich 3909108 1280',NULL,NULL,'{\"210d9fa3-32b0-47ac-a970-3859d419f4c1\": \"tbd.\", \"f7c71e3b-41bf-46f6-920c-4605371cc48e\": \"Pixabay\"}',1,'2023-11-26 12:45:48','2023-11-26 12:45:48','b054b749-00ff-4ef2-b079-522773442628'),(2916,728,3,'Munich 3909108 1280',NULL,NULL,'{\"210d9fa3-32b0-47ac-a970-3859d419f4c1\": \"tbd.\", \"f7c71e3b-41bf-46f6-920c-4605371cc48e\": \"Pixabay\"}',1,'2023-11-26 12:45:48','2023-11-26 12:45:48','0cfc4048-bd29-48dc-b61e-0df5eb2bd313'),(2917,728,7,'Munich 3909108 1280',NULL,NULL,'{\"210d9fa3-32b0-47ac-a970-3859d419f4c1\": \"tbd.\", \"f7c71e3b-41bf-46f6-920c-4605371cc48e\": \"Pixabay\"}',1,'2023-11-26 12:45:48','2023-11-26 12:45:48','47c00a3b-1d5c-41ed-b2e0-f7dd2d5df34e'),(2918,728,8,'Munich 3909108 1280',NULL,NULL,'{\"210d9fa3-32b0-47ac-a970-3859d419f4c1\": \"tbd.\", \"f7c71e3b-41bf-46f6-920c-4605371cc48e\": \"Pixabay\"}',1,'2023-11-26 12:45:48','2023-11-26 12:45:48','1415f827-463e-44be-a9ab-dfa478ff0