זיתות הרוקוקו והגנים השופעים שלו, מעביר את המבקרים לעידן של מלכות בוואריה. הצריחים הנישאים של פראואנקירכה שולטים בנוף העירוני, ומסמלים אמונה וחוסן כאחד. לשוטט ברחובותיה המקסימים של העיר, כאשר כל פינה מספרת סיפור של אלגנטיות ופאר בווארית.\\n\\nמינכן מתהדרת בסצנה תרבותית המתחרה במיטב באירופה. חובבי אמנות יכולים לאבד את עצמם ב-Alte Pinakothek, ביתם של יצירות מופת של אנשים כמו אלברכט דירר ורמברנדט. ה-Pinacotek der Moderne, לעומת זאת, חובק אמנות עכשווית על כל צורותיה. התיאטראות ואולמות הקונצרטים של העיר, כולל התיאטרון הלאומי הנודע והגסטייג, מציגים הצגות שנעות בין יצירות מופת קלאסיות להפקות אוונגרד.\"}',1,'2023-11-27 01:09:51','2023-11-27 01:09:51','b340a346-e076-4388-8ec6-9517b7de5877'),(3184,735,10,NULL,NULL,NULL,'{\"3a0ff308-aab3-40f3-9e76-e651b423ca1c\": \"ארמון נימפנבורג\", \"d2dbe0c8-d8a4-48cc-b4ba-082ee622ac0b\": [\"wide\"]}',1,'2023-11-27 01:09:51','2023-11-27 01:09:51','65a5ea87-58f4-4dff-adcc-738e7e2b5280'),(3185,736,10,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"מינכן היא שם נרדף לאוקטוברפסט, פסטיבל הפולקספסט הגדול בעולם שמושך אליו מיליוני מבקרים מדי שנה. העיר הופכת לחגיגה תוססת של התרבות הבווארית, עם מוזיקה מסורתית, מטבח טעים וכמובן, הבירה הטובה ביותר. מעבר לאוקטוברפסט, גני הבירה של מינכן כמו Hofbräuhaus המפורסם מציעים טעם אותנטי של מבשלות מקומיות ואווירה נעימה המגדירה את אורח החיים הבווארי.\\n\\nהנוף הקולינרי של מינכן הוא הרפתקה גסטרונומית, עם מאכלים בוואריים מסורתיים משלימים השפעות בינלאומיות. מהנקניקיות הלבביות של Viktualienmarkt ועד למסעדות בעלות כוכבי מישלן, העיר נותנת מענה לחיך מגוונים. אל תפספסו את ההזדמנות להתענג על בייגלה או להתפנק עם פרוסה מענגת של אפפלסטרודל תוך כדי סיור בעיר.\\n\\nבמינכן, העבר וההווה מתלכדים ויוצרים אווירה קסומה ודינמית כאחד. בין אם אתם מטיילים בכיכרות היסטוריות, שוקעים באוצרות תרבות, או מגדלת סטיין בגן בירה סואן, מינכן מזמינה אתכם לחוות את השילוב ההרמוני של מסורת, תרבות ועידוד חגיגי. הצטרפו אלינו כשאנו חוקרים את פינותיו של השטיח הבווארי הזה, שבו כל רגע הוא חגיגה של הפיתוי הנצחי של מינכן. פרוסט! 🍻\"}',1,'2023-11-27 01:09:51','2024-03-26 11:00:22','713d86c4-4f84-4bc4-9626-3e1572f31faa'),(3190,4,10,'Home','home','__home__','{\"c1940a37-f8d1-4445-a880-101255bfabe5\": \"מגזין העיר שלך למינכן - שלום!\"}',1,'2023-11-27 01:10:29','2023-11-27 01:10:29','d22bca19-d728-465d-ae51-705a3abc8c7c'),(3210,139,10,'המגזין שלנו','our-magazine','our-magazine','{\"bd99bd78-f4c9-4e15-83ca-230c2479d384\": false, \"c05ea8a3-0b6b-41f7-87be-c356ee495284\": \"Im Grunewald 18\\n\\nBerlin\"}',1,'2023-11-27 01:10:49','2023-11-27 01:10:49','4ba13c88-4816-46e3-b239-bf0839f01eb6'),(3211,142,10,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"🎉 ברוכים הבאים לשטיח התוסס של תרבות, חדשנות והיסטוריה שנמצא בלב המגזין העירוני שלנו, לוכד את המהות של יעדים גרמניים יוצאי דופן.\\n\\n🏙️ __ברלין - איפה ההיסטוריה פוגשת את המודרניות:__\\n\\nצלול לתוך האנרגיה הדינמית של ברלין, שבה כל פינת רחוב לוחשת סיפורים על עבר עשיר. משער ברנדנבורג האייקוני ועד לאמנות הרחוב האקלקטית של גלריית איסט סייד, ברלין היא עיר שמחברת ללא מאמץ היסטוריה עם יצירתיות אוונגרדית. חשפו פנינים נסתרות, חקרו שכונות מגוונות, והתענגו על השילוב של מסורת וחדשנות שהופכת את ברלין לקליידוסקופ תרבותי.\\n\\n\\n🍻 __מינכן - אלגנטיות בווארית והילולת אוקטוברפסט:__\\n\\nטבלו את עצמכם בשטיחי הקיר העשירים של מינכן, עיר המשלבת ללא מאמץ מסורת בווארית עם פיתוי מודרני. לשוטט ברחובות המקסימים המעוטרים באבני חן ארכיטקטוניות, כמו הפאר של ארמון נימפנבורג והצריחים האייקוניים של פראואנקירשה. סצנת התרבות התוססת של מינכן מזמינה אתכם לחקור מוזיאונים ברמה עולמית, בעוד שגני הבירה התוססים שלה ומבשלות הבירה המסורתיות קורצות לכם להתמכר לרוח מחממת הלב של אוקטוברפסט. בין אם אתה שבוי באלגנטיות הקלאסית של בית המגורים או נסחף באווירה העליזה של Viktualienmarkt, מינכן עומדת כעדות לדו-קיום ההרמוני של ההיסטוריה, התרבות והחגיגה המשמחת של החיים. הצטרפו אלינו למסע במטרופולין הבווארי הזה, שבו כל רגע הוא שילוב מענג של תחכום והילולה. 🥨\\n\\n🌊 __המבורג - נמל האפשרויות האינסופיות:__\\n\\nהפליגו להמבורג, עיר שמאמצת את הרוח הימית שלה בזרועות פתוחות. גלו את הפיתוי של האלבפילהרמוניה, טיילו לאורך חוף הים ההומה של שפייכרשטאדט, ותאבדו את עצמכם בשכונות התוססות המשקפות את הקסם הקוסמופוליטי של המבורג. המגזין שלנו הוא המצפן שלך כדי לנווט בין הסיפורים הימיים, התענוגות הגסטרונומיים והנוף התרבותי המתפתח ללא הרף של פנינה ההנזה הזו.\\n\\n🌳 __סולטאו - מקלט הטבע בהיטס:__\\n\\nברחו לחיבוק השליו של סולטאו, שם הטבע תופס את מרכז הבמה. חקור את הנופים הקסומים של Lüneburg Heath, להירגע בצמחייה השופעת של Soltau Heathland, ולהתמכר להנאות החיים הפשוטות. המגזין שלנו מזמין אתכם לגלות את אבני החן הנסתרות, את הרפתקאות החוץ ואת היופי השלו שהופכים את סולטאו למקום מפלט עבור אלה שמחפשים נסיגה אל הטבע.\\n\\n\\n📖 בדפים שלנו, תמצאו אוסף אצור של סיפורים, תכונות ותובנות המציגות את הרוח של הערים הללו. בין אם אתה תושב או מבקר סקרן, הצטרף אלינו למסע בין השטיחים המגוון של הערים. ברוכים הבאים לסיפון בזמן שאנו חוקרים, חוגגים וחושפים את הדופק של היעדים המדהימים האלה! 🌍📸\\n\\n\\\\#CityVibesMagazine #DiscoverBerlinHamburgSoltau\"}',1,'2023-11-27 01:10:49','2024-03-26 11:00:23','a247325f-eada-492d-b83c-5cf11b0a5f63'),(3212,234,10,'כזה','search','search','{\"84760a94-cb38-424c-89e3-94ec494bf991\": false}',1,'2023-11-27 01:10:49','2023-11-27 01:10:49','4907910c-d04e-4fc5-90b5-84deace5f596'),(3213,302,10,'נושאים','topics','topics','{\"1be82713-a59c-499a-83b6-f3bfcb21c646\": true}',1,'2023-11-27 01:10:49','2023-11-27 01:10:49','d383f287-709e-4387-a6c7-a0d9d9e13e57'),(3214,348,10,'מאמרים','articles','articles','{\"130dff67-c8fe-4e57-bd48-4275a86b9c11\": true}',1,'2023-11-27 01:10:50','2023-11-27 01:10:50','bf12ee7a-f1f2-45e5-9759-dda4eacb5085'),(3228,1,10,'Site Info - Global Settings','site-info-global-settings',NULL,'{\"0b7b855c-3f2f-4d39-8ef0-e5fccd7a2685\": \"מגזין סיטי\", \"c544e80e-5800-4486-82be-1c01d88af25f\": false, \"c5b5269f-b571-4e25-af4c-6cdfdc2fbf56\": \"Perlen vor die Säue GmbH\"}',1,'2023-11-27 01:10:57','2023-11-27 01:10:57','b07d626f-868f-4b80-9418-31650d8c0d71'),(3259,671,10,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"היכרות קצרה עם העיר\"}',1,'2023-11-27 01:12:12','2023-11-27