',1,'2023-11-27 02:43:16','2023-11-27 02:43:16','366404be-4586-4ff8-a3c5-4beabb2ff3d5'),(3665,831,8,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"The Munich Synagogue, an architectural jewel in the heart of the Bavarian capital, shines as a symbol of the Jewish community and its cultural heritage. The synagogue was inaugurated in 2006 and impresses with its modern aesthetics, which are nevertheless deeply rooted in history and tradition. The building, designed by renowned architects Wandel Hoefer Lorch + Hirsch, harmoniously combines elements of Judaism with contemporary design. The clean lines and transparency of the glass façade create an inviting atmosphere that invites visitors to discover the rich history and vibrant present of Jewish culture.\\n\\nThe synagogue is not only a religious center, but also a place of encounter and intercultural exchange. The community regularly organizes events, lectures and cultural activities that bring people from different backgrounds together. Visitors have the opportunity to take part in guided tours to learn more about the history of the Jewish community in Munich and experience the importance of the synagogue as a place of prayer, education and dialog. The Munich Synagogue is therefore not only an architectural masterpiece, but also a living testimony to the diversity and openness of the city.\"}',1,'2023-11-27 02:43:16','2023-11-27 02:43:16','7196fcb6-92fc-4778-aa7d-0a48dc23d8c2'),(3666,831,7,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"Die Münchener Synagoge, ein architektonisches Juwel inmitten der bayerischen Hauptstadt, erstrahlt als Symbol der jüdischen Gemeinschaft und ihres kulturellen Erbes. Die Synagoge wurde im Jahr 2006 eingeweiht und beeindruckt durch ihre moderne Ästhetik, die dennoch tief in der Geschichte und Tradition verwurzelt ist. Das Gebäude, entworfen von den renommierten Architekten Wandel Hoefer Lorch + Hirsch, verbindet harmonisch Elemente des Judentums mit zeitgenössischem Design. Die klaren Linien und die Transparenz der Glasfassade schaffen eine einladende Atmosphäre, die Besucher dazu einlädt, die reiche Geschichte und die lebendige Gegenwart der jüdischen Kultur zu entdecken.\\n\\nDie Synagoge ist nicht nur ein religiöses Zentrum, sondern auch ein Ort der Begegnung und des interkulturellen Austauschs. Die Gemeinde organisiert regelmäßig Veranstaltungen, Vorträge und kulturelle Aktivitäten, die Menschen unterschiedlicher Hintergründe zusammenbringen. Besucher haben die Möglichkeit, an Führungen teilzunehmen, um mehr über die Geschichte der jüdischen Gemeinschaft in München zu erfahren und die Bedeutung der Synagoge als Ort des Gebets, der Bildung und des Dialogs zu erleben. Die Münchener Synagoge ist somit nicht nur ein architektonisches Meisterwerk, sondern auch ein lebendiges Zeugnis für die Vielfalt und Offenheit der Stadt.\"}',1,'2023-11-27 02:43:16','2023-11-27 02:43:16','73f680b9-7799-440c-b3e8-c2e22d66fc5a'),(3667,831,9,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"La Sinagoga di Monaco, gioiello architettonico nel centro della capitale bavarese, brilla come simbolo della comunità ebraica e del suo patrimonio culturale. Inaugurata nel 2006, la sinagoga colpisce per la sua estetica moderna, ma profondamente radicata nella storia e nella tradizione. L\'edificio, progettato dai famosi architetti Wandel Hoefer Lorch + Hirsch, combina armoniosamente elementi dell\'ebraismo con il design contemporaneo. Le linee pulite e la trasparenza della facciata in vetro creano un\'atmosfera invitante che invita i visitatori a scoprire la ricca storia e il vibrante presente della cultura ebraica.\\n\\nLa sinagoga non è solo un centro religioso, ma anche un luogo di incontro e scambio interculturale. La comunità organizza regolarmente eventi, conferenze e attività culturali che riuniscono persone di diversa provenienza. I visitatori hanno la possibilità di partecipare a visite guidate per conoscere meglio la storia della comunità ebraica di Monaco e sperimentare l\'importanza della sinagoga come luogo di preghiera, educazione e dialogo. La Sinagoga di Monaco non è quindi solo un capolavoro architettonico, ma anche una testimonianza vivente della diversità e dell\'apertura della città.\"}',1,'2023-11-27 02:43:16','2023-11-27 02:43:16','6d1b8b43-360e-4e7f-a2b6-59dfe6a00817'),(3668,831,10,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"בית הכנסת במינכן, תכשיט ארכיטקטוני באמצע בירת בוואריה, זוהר כסמל לקהילה היהודית ולמורשת התרבותית שלה. בית הכנסת נחנך בשנת 2006 ומרשים באסתטיקה המודרנית שלו, אשר בכל זאת נטועה עמוק בהיסטוריה ובמסורת. הבניין, שתוכנן על ידי האדריכלים הנודעים ונדל חופר לורך + הירש, משלב בהרמוניה אלמנטים של יהדות עם עיצוב עכשווי. הקווים הנקיים והשקיפות של חזית הזכוכית יוצרים אווירה מסבירת פנים המזמינה את המבקרים לגלות את ההיסטוריה העשירה וההווה התוסס של התרבות היהודית.\\n\\nבית הכנסת הוא לא רק מרכז דתי, אלא גם מקום מפגש וחילופים בין-תרבותיים. הקהילה מארגנת באופן קבוע אירועים, הרצאות ופעילויות תרבות המפגישות אנשים מרקעים שונים. למבקרים יש הזדמנות לערוך סיורים מודרכים כדי ללמוד עוד על ההיסטוריה של הקהילה היהודית במינכן ולחוות את חשיבותו של בית הכנסת כמקום של תפילה, חינוך ודיאלוג. בית הכנסת במינכן הוא לא רק יצירת מופת אדריכלית, אלא גם עדות חיה לגיוון ולפתיחות של העיר.\"}',1,'2023-11-27 02:43:16','2023-11-27 02:43:16','2bfc8af0-bab6-48a8-a86b-4c9434c9accd'),(3725,846,7,'Die Top 6 Museen der bayerischen Metropole: Entdecke die Kulturperlen Münchens','die-top-6-museen-der-bayerischen-metropole-entdecke-die-kulturperlen-munchens','artikel/die-top-6-museen-der-bayerischen-metropole-entdecke-die-kulturperlen-munchens','{\"af872e03-1253-4002-8d19-6dae768135a3\": false}',1,'2023-11-28 08:06:58','2023-11-28 08:47:04','dfb1142b-b9ca-4954-bb60-69e7c2c084e1'),(3726,846,8,'The top 6 museums in the Bavarian metropolis: discover Munich\'s cultural gems','the-top-6-museums-in-the-bavarian-metropolis-discover-munichs-cultural-gems','articles/the-top-6-museums-in-the-bavarian-metropoli