t, history and science in a fascinating way. Let\'s immerse ourselves in Munich\'s rich cultural landscape and discover the best museums that are definitely worth a visit.\"}',1,'2023-11-28 08:13:46','2023-11-28 08:13:46','b0f2a04f-7e0d-457b-a4c4-97ea4c7c6e2d'),(3959,899,9,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"Monaco di Baviera, la vivace capitale bavarese, non è solo nota per la sua vivace cultura della birra e per i suoi magnifici edifici, ma ospita anche un\'impressionante varietà di musei che presentano arte, storia e scienza in modo affascinante. Immergiamoci nel ricco panorama culturale di Monaco e scopriamo i migliori musei che meritano sicuramente una visita.\"}',1,'2023-11-28 08:13:46','2023-11-28 08:13:46','9621ef51-a40f-44c0-a142-15edd6415b2d'),(3960,899,10,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"München, die pulsierende bayerische Hauptstadt, ist nicht nur für ihre lebendige Bierkultur und prächtigen Bauten bekannt, sondern beherbergt auch eine beeindruckende Vielfalt an Museen, die Kunst, Geschichte und Wissenschaft auf faszinierende Weise präsentieren. Tauchen wir ein in die reiche Kulturlandschaft Münchens und entdecken die besten Museen, die einen Besuch definitiv lohnen.\"}',1,'2023-11-28 08:13:46','2023-11-28 08:13:46','db78d968-385b-45d6-9d31-ac097119eee9'),(3961,900,7,NULL,NULL,NULL,'{\"1eba02c7-3ca9-4e5e-a0f8-53a781379216\": \"Dienstag bis Sonntag, 10:00 Uhr bis 18:00 Uh\", \"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"Alte Pinakothek: Meisterwerke der europäischen Malerei\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"Die Alte Pinakothek zählt zu den ältesten und bedeutendsten Kunstsammlungen der Welt. Hier können Besucher Meisterwerke europäischer Malerei bewundern, von Künstlern wie Albrecht Dürer über Rembrandt bis hin zu Rubens. Die prachtvollen Gemälde bieten einen faszinierenden Einblick in die Entwicklung der Kunstgeschichte und lassen die Herzen von Kunstliebhabern höherschlagen.\", \"d433292f-8470-42e4-98a1-eeace1ef06b0\": \"https://www.pinakothek.de/de/besuch/alte-pinakothek\"}',1,'2023-11-28 08:13:46','2024-03-26 11:00:23','76c7399e-883b-404f-b596-3b1c56884679'),(3962,900,8,NULL,NULL,NULL,'{\"1eba02c7-3ca9-4e5e-a0f8-53a781379216\": \"Tuesday to Sunday, 10:00 am to 6:00 pm\", \"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"Alte Pinakothek: Masterpieces of European painting\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"The Alte Pinakothek is one of the oldest and most important art collections in the world. Here, visitors can admire masterpieces of European painting, from artists such as Albrecht Dürer to Rembrandt and Rubens. The magnificent paintings offer a fascinating insight into the development of art history and make the hearts of art lovers beat faster.\", \"d433292f-8470-42e4-98a1-eeace1ef06b0\": \"https://www.pinakothek.de/en/visit/alte-pinakothek\"}',1,'2023-11-28 08:13:46','2024-03-26 11:00:23','23970b7a-3952-41f1-a191-bfb139ca7cc2'),(3963,900,9,NULL,NULL,NULL,'{\"1eba02c7-3ca9-4e5e-a0f8-53a781379216\": \"Da martedì a domenica, dalle 10:00 alle 18:00\", \"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"Alte Pinakothek: capolavori della pittura europea\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"L\'Alte Pinakothek è una delle più antiche e importanti collezioni d\'arte del mondo. Qui i visitatori possono ammirare i capolavori della pittura europea, da artisti come Albrecht Dürer a Rembrandt e Rubens. I magnifici dipinti offrono un\'affascinante visione dello sviluppo della storia dell\'arte e fanno battere forte il cuore degli amanti dell\'arte.\", \"d433292f-8470-42e4-98a1-eeace1ef06b0\": \"https://www.pinakothek.de/de/besuch/alte-pinakothek\"}',1,'2023-11-28 08:13:46','2024-03-26 11:00:23','e263dbfa-1333-491e-918b-6a27be752766'),(3964,900,10,NULL,NULL,NULL,'{\"1eba02c7-3ca9-4e5e-a0f8-53a781379216\": \"Dienstag bis Sonntag, 10:00 Uhr bis 18:00 Uh\", \"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"Alte Pinakothek: Meisterwerke der europäischen Malerei\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"Die Alte Pinakothek zählt zu den ältesten und bedeutendsten Kunstsammlungen der Welt. Hier können Besucher Meisterwerke europäischer Malerei bewundern, von Künstlern wie Albrecht Dürer über Rembrandt bis hin zu Rubens. Die prachtvollen Gemälde bieten einen faszinierenden Einblick in die Entwicklung der Kunstgeschichte und lassen die Herzen von Kunstliebhabern höherschlagen.\", \"d433292f-8470-42e4-98a1-eeace1ef06b0\": \"https://www.pinakothek.de/de/besuch/alte-pinakothek\"}',1,'2023-11-28 08:13:46','2024-03-26 11:00:23','33be7bd2-1d34-4bd2-9ce4-210346bfd595'),(3965,901,7,NULL,NULL,NULL,'{\"1eba02c7-3ca9-4e5e-a0f8-53a781379216\": \"Montag bis Sonntag, 9:00 Uhr bis 17:00 Uhr\", \"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"Deutsches Museum: Technik und Wissenschaft zum Anfassen\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"Für Technik- und Wissenschaftsbegeisterte ist das Deutsche Museum ein absolutes Muss. Als eines der größten naturwissenschaftlich-technischen Museen der Welt präsentiert es interaktive Ausstellungen zu Themen wie Physik, Astronomie und Fortschritt der Technologie. Mit zahlreichen Experimentierstationen und beeindruckenden Exponaten bietet das Museum eine unterhaltsame und lehrreiche Erfahrung für Besucher aller Altersgruppen.\", \"d433292f-8470-42e4-98a1-eeace1ef06b0\": \"https://www.deutsches-museum.de/\"}',1,'2023-11-28 08:13:46','2024-03-26 11:00:23','6108eef2-281e-4ec9-89be-eb2a06a94843'),(3966,901,8,NULL,NULL,NULL,'{\"1eba02c7-3ca9-4e5e-a0f8-53a781379216\": \"Monday to Sunday, 9:00 am to 5:00 pm\", \"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"Deutsches Museum: hands-on technology and science\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"The Deutsches Museum is an absolute must for technology and science enthusiasts. As one of the largest science and technology museums in the world, it presents interactive exhibitions on topics such as physics, astronomy and advances in technology. With numerous experimental stations and impressive exhibits, the museum offers an entertaining and educational experience for visitors of all ages.\", \"d433292f-8470-42e4-98a1-eeace1ef06b0\": \"https://www.deutsches-museum.de/\"}',1,'2023-11-28 08:13:46','2024-03-26 11:00:23','87c5cec3-7fd2-494b-b47c-8e0d202451e4'),(3967,901,9,NULL,NULL,NULL,'{\"1eba02c7-3ca9-4e5e-a0f8-53a781379216\": \"Da lunedì a domenica, dalle 9:00 alle 17:00\", \"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"Deutsches Museum: tecnologia e scienza da toccare con mano\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"Il Deutsches Museum è una tappa obbligata per gli appassionati di tecnologia e scienza. È uno dei più grandi musei scientifici e tecnologici del mondo e presenta mostre interattive su temi quali la fisica, l\'astronomia e i progressi della tecnologia. Con numerose stazioni sperimentali e mostre impressionanti, il museo offre un\'esperienza divertente ed educativa per i visitatori di tutte le età.\"}',1,'2023-11-28 08:13:46','2024-03-26 11:00:23','3bc98707-3887-48ca-91e6-c97c7b5b9012'),(3968,901,10,NULL,NULL,NULL,'{\"1eba02c7-3ca9-4e5e-a0f8-53a781379216\": \"Montag bis Sonntag, 9:00 Uhr bis 17:00 Uhr\", \"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"Deutsches Museum: Technik und Wissenschaft zum Anfassen\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"Für Technik- und Wissenschaftsbegeisterte ist das Deutsche Museum ein absolutes Muss. Als eines der größten naturwissenschaftlich-technischen Museen der Welt präsentiert es interaktive Ausstellungen zu Themen wie Physik, Astronomie und Fortschritt der Technologie. Mit zahlreichen Experimentierstationen und beeindruckenden Exponaten bietet das Museum eine unterhaltsame und lehrreiche Erfahrung für Besucher aller Altersgruppen.\"}',1,'2023-11-28 08:13:46','2024-03-26 11:00:23','c576d7f1-962a-46a1-966f-c5748a920fe4'),(4141,945,7,'Pinakothek der Moderne','pinakothek-der-moderne','locations/pinakothek-der-moderne','{\"bdb6f666-a7d8-4206-ac3d-47159c88280f\": \"Barer Str. 4