Entdecke die Kulturperlen Münchens','die-top-6-museen-der-bayerischen-metropole-entdecke-die-kulturperlen-munchens','artikel/die-top-6-museen-der-bayerischen-metropole-entdecke-die-kulturperlen-munchens','{\"af872e03-1253-4002-8d19-6dae768135a3\": false}',1,'2023-11-28 10:24:47','2023-11-28 10:24:47','dc98d0b5-e0b2-4f5d-aed4-c0340004e8c9'),(4727,1097,8,'The top 6 museums in the Bavarian metropolis: discover Munich\'s cultural gems','the-top-6-museums-in-the-bavarian-metropolis-discover-munichs-cultural-gems','articles/the-top-6-museums-in-the-bavarian-metropolis-discover-munichs-cultural-gems','{\"af872e03-1253-4002-8d19-6dae768135a3\": false}',1,'2023-11-28 10:24:47','2023-11-28 10:24:47','41dc257f-f7d5-41c9-b753-7de7906a060c'),(4728,1097,10,'Die Top 6 Museen der bayerischen Metropole: Entdecke die Kulturperlen Münchens:','die-top-6-museen-der-bayerischen-metropole-entdecke-die-kulturperlen-munchens','articles/die-top-6-museen-der-bayerischen-metropole-entdecke-die-kulturperlen-munchens','{\"af872e03-1253-4002-8d19-6dae768135a3\": false}',0,'2023-11-28 10:24:47','2023-11-28 10:24:47','26507d52-a55a-4f87-8c4a-a23d05f2552a'),(4729,1098,9,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"Monaco di Baviera, la vivace capitale bavarese, non è solo nota per la sua vivace cultura della birra e per i suoi magnifici edifici, ma ospita anche un\'impressionante varietà di musei che presentano arte, storia e scienza in modo affascinante. Immergiamoci nel ricco panorama culturale di Monaco e scopriamo i migliori musei che meritano sicuramente una visita.\"}',1,'2023-11-28 10:24:47','2023-11-28 10:24:47','5e2182fd-2459-4d01-a941-67638a79632d'),(4730,1098,7,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"München, die pulsierende bayerische Hauptstadt, ist nicht nur für ihre lebendige Bierkultur und prächtigen Bauten bekannt, sondern beherbergt auch eine beeindruckende Vielfalt an Museen, die Kunst, Geschichte und Wissenschaft auf faszinierende Weise präsentieren. Tauchen wir ein in die reiche Kulturlandschaft Münchens und entdecken die besten Museen, die einen Besuch definitiv lohnen.\"}',1,'2023-11-28 10:24:47','2023-11-28 10:24:47','0b36428a-fdcc-40e4-876d-bd212ef0c98f'),(4731,1098,8,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"Munich, the vibrant Bavarian capital, is not only known for its lively beer culture and magnificent buildings, but is also home to an impressive variety of museums that present art, history and science in a fascinating way. Let\'s immerse ourselves in Munich\'s rich cultural landscape and discover the best museums that are definitely worth a visit.\"}',1,'2023-11-28 10:24:47','2023-11-28 10:24:47','9b591709-73dd-4704-b7c1-44b4ec6d31fa'),(4732,1098,10,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"München, die pulsierende bayerische Hauptstadt, ist nicht nur für ihre lebendige Bierkultur und prächtigen Bauten bekannt, sondern beherbergt auch eine beeindruckende Vielfalt an Museen, die Kunst, Geschichte und Wissenschaft auf faszinierende Weise präsentieren. Tauchen wir ein in die reiche Kulturlandschaft Münchens und entdecken die besten Museen, die einen Besuch definitiv lohnen.\"}',1,'2023-11-28 10:24:47','2023-11-28 10:24:47','3d623727-7aa8-4e56-bcd9-f34d502503c0'),(4733,1099,9,NULL,NULL,NULL,'{\"1eba02c7-3ca9-4e5e-a0f8-53a781379216\": \"Da martedì a domenica, dalle 10:00 alle 18:00\", \"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"Alte Pinakothek: capolavori della pittura europea\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"L\'Alte Pinakothek è una delle più antiche e importanti collezioni d\'arte del mondo. Qui i visitatori possono ammirare i capolavori della pittura europea, da artisti come Albrecht Dürer a Rembrandt e Rubens. I magnifici dipinti offrono un\'affascinante visione dello sviluppo della storia dell\'arte e fanno battere forte il cuore degli amanti dell\'arte.\", \"d433292f-8470-42e4-98a1-eeace1ef06b0\": \"https://www.pinakothek.de/de/besuch/alte-pinakothek\"}',1,'2023-11-28 10:24:47','2023-11-28 10:24:47','6534a1d9-73bd-4c38-9a34-efb6d500801a'),(4734,1099,7,NULL,NULL,NULL,'{\"1eba02c7-3ca9-4e5e-a0f8-53a781379216\": \"Dienstag bis Sonntag, 10:00 Uhr bis 18:00 Uh\", \"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"Alte Pinakothek: Meisterwerke der europäischen Malerei\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"Die Alte Pinakothek zählt zu den ältesten und bedeutendsten Kunstsammlungen der Welt. Hier können Besucher Meisterwerke europäischer Malerei bewundern, von Künstlern wie Albrecht Dürer über Rembrandt bis hin zu Rubens. Die prachtvollen Gemälde bieten einen faszinierenden Einblick in die Entwicklung der Kunstgeschichte und lassen die Herzen von Kunstliebhabern höherschlagen.\", \"d433292f-8470-42e4-98a1-eeace1ef06b0\": \"https://www.pinakothek.de/de/besuch/alte-pinakothek\"}',1,'2023-11-28 10:24:47','2023-11-28 10:24:47','b20965a6-3a2d-4293-b2f7-8793fb4575a3'),(4735,1099,8,NULL,NULL,NULL,'{\"1eba02c7-3ca9-4e5e-a0f8-53a781379216\": \"Tuesday to Sunday, 10:00 am to 6:00 pm\", \"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"Alte Pinakothek: Masterpieces of European painting\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"The Alte Pinakothek is one of the oldest and most important art collections in the world. Here, visitors can admire masterpieces of European painting, from artists such as Albrecht Dürer to Rembrandt and Rubens. The magnificent paintings offer a fascinating insight into the development of art history and make the hearts of art lovers beat faster.\", \"d433292f-8470-42e4-98a1-eeace1ef06b0\": \"https://www.pinakothek.de/en/visit/alte-pinakothek\"}',1,'2023-11-28 10:24:48','2023-11-28 10:24:48','893ff754-8d59-4cc8-abb8-07c9b6b82682'),(4736,1099,10,NULL,NULL,NULL,'{\"1eba02c7-3ca9-4e5e-a0f8-53a781379216\": \"Dienstag bis Sonntag, 10:00 Uhr bis 18:00 Uh\", \"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"Alte Pinakothek: Meisterwerke der europäischen Malerei\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"Die Alte Pinakothek zählt zu den ältesten und bedeutendsten Kunstsammlungen der Welt. Hier können Besucher Meisterwerke europäischer Malerei bewundern, von Künstlern wie Albrecht Dürer über Rembrandt bis hin zu Rubens. Die prachtvollen Gemälde bieten einen faszinierenden Einblick in die Entwicklung der Kunstgeschichte und lassen die Herzen von Kunstliebhabern höherschlagen.\", \"d433292f-8470-42e4-98a1-eeace1ef06b0\": \"https://www.pinakothek.de/de/besuch/alte-pinakothek\"}',1,'2023-11-28 10:24:48','2023-11-28 10:24:48','0afce4a2-53b8-4c25-ba32-fa0beaf950fc'),(4737,1100,9,NULL,NULL,NULL,'{\"1eba02c7-3ca9-4e5e-a0f8-53a781379216\": \"Da lunedì a domenica, dalle 9:00 alle 17:00\", \"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"Deutsches Museum: tecnologia e scienza da toccare con mano\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"Il Deutsches Museum è una tappa obbligata per gli appassionati di tecnologia e scienza. È uno dei più grandi musei scientifici e tecnologici del mondo e presenta mostre interattive su temi quali la fisica, l\'astronomia e i progressi della tecnologia. Con numerose stazioni sperimentali e mostre impressionanti, il museo offre un\'esperienza divertente ed educativa per i visitatori di tutte le età.\"}',1,'2023-11-28 10:24:48','2023-11-28 10:24:48','a3c1fecd-4938-446c-b144-6e0334fbdf5f'),(4738,1100,7,NULL,NULL,NULL,'{\"1eba02c7-3ca9-4e5e-a0f8-53a781379216\": \"Montag bis Sonntag, 9:00 Uhr bis 17:00 Uhr\", \"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"Deutsches Museum: Technik und Wissenschaft zum Anfassen\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"Für Technik- und Wissenschaftsbegeisterte ist das Deutsche Museum ein absolutes Muss. Als eines der größten naturwissenschaftlich-technischen Museen der Welt präsentiert es interaktive Ausstellungen zu Themen wie Physik, Astronomie und Fortschritt der Technologie. Mit zahlreichen Experimentierstationen und beeindruckenden Exponaten bietet das Museum eine unterhaltsame und lehrreiche Erfahrung für Besucher aller Altersgruppen.\", \"d433292f-8470-42e4-98a1-eeace1ef06b0\": \"https://www.deutsches-museum.de/\"}',1,'2023-11-28 10:24:48','2023-11-28 10:24:48','110f8ce9-b107-4686-a8dd-6a24b9e1ec3d'),(4739,1100,8,NULL,NULL,NULL,'{\"1eba02c7-3ca9-4e5e-a0f8-53a781379216\": \"Monday to Sunday, 9:00 am to 5:00 pm\", \"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"Deutsches Museum: hands-on technology and science\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"The Deutsches Museum is an absolute must for technology and science enthusiasts. As one of the largest science and technology museums in the world, it presents interactive exhibitions on topics such as physics, astronomy and advances in technology. With numerous experimental stations and impressive exhibits, the museum offers an entertaining and educational experience for visitors of all ages.\", \"d433292f-8470-42e4-98a1-eeace1ef06b0\": \"https://www.deutsches-museum.de/\"}',1,'2023-11-28 10:24:48','2023-11-28 10:24:48','1e58a235-2833-4d4b-be46-fb2164b666e1'),(4740,1100,10,NULL,NULL,NULL,'{\"1eba02c7-3ca9-4e5e-a0f8-53a781379216\": \"Montag bis Sonntag, 9:00 Uhr bis 17:00 Uhr\", \"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"Deutsches Museum: Technik und Wissenschaft zum Anfassen\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"Für Technik- und Wissenschaftsbegeisterte ist das Deutsche Museum ein absolutes Muss. Als eines der größten naturwissenschaftlich-technischen Museen der Welt präsentiert es interaktive Ausstellungen zu Themen wie Physik, Astronomie und Fortschritt der Technologie. Mit zahlreichen Experimentierstationen und beeindruckenden Exponaten bietet das Museum eine unterhaltsame und lehrreiche Erfahrung für Besucher aller Altersgruppen.\"}',1,'2023-11-28 10:24:48','2023-11-28 10:24:48','d661b15c-6ea6-40c2-8b43-fa176bc5cd76'),(4741,1101,9,NULL,NULL,NULL,'{\"1eba02c7-3ca9-4e5e-a0f8-53a781379216\": \"Da martedì a domenica, dalle 10:00 alle 18:00; giovedì fino alle 20:00.\", \"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"Pinakothek der Moderne: l\'arte contemporanea in tutto il suo splendore\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"La Pinakothek der Moderne riunisce sotto lo stesso tetto quattro diverse collezioni: arte, grafica, architettura e design. Qui i visitatori possono ammirare l\'arte contemporanea di artisti di fama internazionale. La variegata collezione riflette la diversità creativa della scena artistica moderna e incoraggia la riflessione su temi sociali attuali.\"}',1,'2023-11-28 10:24:48','2023-11-28 10:24:48','b9634606-acd8-4b5b-a612-2b319a36e4e7'),(4742,1101,7,NULL,NULL,NULL,'{\"1eba02c7-3ca9-4e5e-a0f8-53a781379216\": \"Dienstag bis Sonntag, 10:00 Uhr bis 18:00 Uhr; Donnerstag bis 20:00 Uhr\", \"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"Pinakothek der Moderne: Zeitgenössische Kunst in voller Pracht\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"Die Pinakothek der Moderne vereint vier verschiedene Sammlungen unter einem Dach: Kunst, Grafikdesign, Architektur und Design. Hier können Besucher zeitgenössische Kunst von international renommierten Künstlern erleben. Die vielfältige Sammlung reflektiert die kreative Vielfalt der modernen Kunstszene und regt zum Nachdenken über aktuelle gesellschaftliche Themen an.\", \"d433292f-8470-42e4-98a1-eeace1ef06b0\": \"https://www.pinakothek-der-moderne.de/\"}',1,'2023-11-28 10:24:48','2023-11-28 10:24:48','70a5a6d3-6b9b-48e8-9b6b-6eebed7d9623'),(4743,1101,8,NULL,NULL,NULL,'{\"1eba02c7-3ca9-4e5e-a0f8-53a781379216\": \"Tuesday to Sunday, 10:00 a.m. to 6:00 p.m.; Thursday until 8:00 p.m.\", \"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"Pinakothek der Moderne: contemporary art in all its glory\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"The Pinakothek der Moderne unites four different collections under one roof: art, graphic design, architecture and design. Here, visitors can experience contemporary art by internationally renowned artists. The diverse collection reflects the creative diversity of the modern art scene and encourages reflection on current social issues.\", \"d433292f-8470-42e4-98a1-eeace1ef06b0\": \"https://www.pinakothek-der-moderne.de/en/\"}',1,'2023-11-28 10:24:48','2023-11-28 10:24:48','b201cf11-22ce-4bff-8552-970fb65e5b9a'),(4744,1101,10,NULL,NULL,NULL,'{\"1eba02c7-3ca9-4e5e-a0f8-53a781379216\": \"Dienstag bis Sonntag, 10:00 Uhr bis 18:00 Uhr; Donnerstag bis 20:00 Uhr\", \"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"Pinakothek der Moderne: Zeitgenössische Kunst in voller Pracht\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"Die Pinakothek der Moderne vereint vier verschiedene Sammlungen unter einem Dach: Kunst, Grafikdesign, Architektur und Design. Hier können Besucher zeitgenössische Kunst von international renommierten Künstlern erleben. Die vielfältige Sammlung reflektiert die kreative Vielfalt der modernen Kunstszene und regt zum Nachdenken über aktuelle gesellschaftliche Themen an.\"}',1,'2023-11-28 10:24:48','2023-11-28 10:24:48','e029e859-4ac5-4b42-8ea0-9d606f0dbd80'),(4745,1102,9,NULL,NULL,NULL,'{\"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"Museo BMW: un viaggio nella storia della mobilità\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"Il Museo BMW è un vero paradiso per gli appassionati di automobili. L\'esposizione conduce i visitatori attraverso l\'affascinante storia del marchio BMW e lo sviluppo di veicoli che non sono solo mezzi di trasporto, ma anche opere d\'arte su ruote. Dai modelli storici alle visionarie concept car, il museo offre una prospettiva impressionante sul mondo della mobilità.\"}',1,'2023-11-28 10:24:48','2023-11-28 10:24:48','e401f4f2-3595-47cb-b84e-773a5f7c3fb6'),(4746,1102,7,NULL,NULL,NULL,'{\"1eba02c7-3ca9-4e5e-a0f8-53a781379216\": \"Dienstag bis Sonntag, 10:00 Uhr bis 18:00 Uhr\", \"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"BMW Museum: Eine Reise durch die Geschichte der Mobilität\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"Für Automobil-Enthusiasten ist das BMW Museum ein wahres Paradies. Die Ausstellung führt Besucher durch die faszinierende Geschichte der Marke BMW und die Entwicklung von Fahrzeugen, die nicht nur Fortbewegungsmittel, sondern auch Kunstwerke auf Rädern sind. Von historischen Modellen bis zu visionären Konzeptfahrzeugen bietet das Museum eine beeindruckende Perspektive auf die Welt der Mobilität.\", \"d433292f-8470-42e4-98a1-eeace1ef06b0\": \"https://www.bmw-welt.com/de/index.html\"}',1,'2023-11-28 10:24:48','2023-11-28 10:24:48','c24b07d3-1e72-495e-92a2-6838f05b96f4'),(4747,1102,8,NULL,NULL,NULL,'{\"1eba02c7-3ca9-4e5e-a0f8-53a781379216\": \"Tuesday to Sunday, 10:00 am to 6:00 pm\", \"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"BMW Museum: A journey through the history of mobility\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"The BMW Museum is a true paradise for automobile enthusiasts. The exhibition takes visitors through the fascinating history of the BMW brand and the development of vehicles that are not only means of transportation, but also works of art on wheels. From historic models to visionary concept cars, the museum offers an impressive perspective on the world of mobility.\", \"d433292f-8470-42e4-98a1-eeace1ef06b0\": \"https://www.bmw-welt.com/en/index.html\"}',1,'2023-11-28 10:24:48','2023-11-28 10:24:48','b7d121fb-891f-48a8-b4d9-ce96ff05053f'),(4748,1102,10,NULL,NULL,NULL,'{\"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"BMW Museum: Eine Reise durch die Geschichte der Mobilität\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"Für Automobil-Enthusiasten ist das BMW Museum ein wahres Paradies. Die Ausstellung führt Besucher durch die faszinierende Geschichte der Marke BMW und die Entwicklung von Fahrzeugen, die nicht nur Fortbewegungsmittel, sondern auch Kunstwerke auf Rädern sind. Von historischen Modellen bis zu visionären Konzeptfahrzeugen bietet das Museum eine beeindruckende Perspektive auf die Welt der Mobilität.\"}',1,'2023-11-28 10:24:48','2023-11-28 10:24:48','c0f4064f-baf4-47e1-94e3-1573a519cf98'),(4749,1103,9,NULL,NULL,NULL,'{\"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"Museo ebraico di Monaco: Testimonianza della storia e della cultura ebraica\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"Il Museo ebraico di Monaco racconta la storia della comunità ebraica di Monaco e della Baviera. Le mostre fanno luce sulla cultura, le tradizioni e il destino travagliato della popolazione ebraica. Oltre ai reperti storici, vengono presentate anche opere artistiche contemporanee che illustrano l\'importanza della cultura ebraica a Monaco oggi.\"}',1,'2023-11-28 10:24:48','2023-11-28 10:24:48','f2bdb7f9-c0f7-4bb3-8784-e1b73cb068b7'),(4750,1103,7,NULL,NULL,NULL,'{\"1eba02c7-3ca9-4e5e-a0f8-53a781379216\": \"Sonntag bis Donnerstag, 10:00 Uhr bis 18:00 Uhr; Freitag, 10:00 Uhr bis 14:00 Uhr\", \"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"Jüdisches Museum München: Zeugnis jüdischer Geschichte und Kultur\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"Das Jüdische Museum München erzählt die Geschichte der jüdischen Gemeinschaft in München und Bayern. Die Ausstellungen beleuchten die vielfältige Kultur, Traditionen und das wechselhafte Schicksal der jüdischen Bevölkerung. Neben historischen Artefakten werden auch zeitgenössische künstlerische Arbeiten präsentiert, die die Bedeutung der jüdischen Kultur im heutigen München verdeutlichen.\", \"d433292f-8470-42e4-98a1-eeace1ef06b0\": \"https://www.juedisches-museum-muenchen.de/\"}',1,'2023-11-28 10:24:48','2023-11-28 10:24:48','b93bf3eb-2e05-4310-b2c2-59b91f485212'),(4751,1103,8,NULL,NULL,NULL,'{\"1eba02c7-3ca9-4e5e-a0f8-53a781379216\": \"Sunday to Thursday, 10:00 a.m. to 6:00 p.m.; Friday, 10:00 a.m. to 2:00 p.m.\", \"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"Jewish Museum Munich: Testimony to Jewish history and culture\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"The Jewish Museum Munich tells the story of the Jewish community in Munich and Bavaria. The exhibitions shed light on the diverse culture, traditions and eventful fate of the Jewish population. In addition to historical artifacts, contemporary artistic works are also presented that illustrate the significance of Jewish culture in Munich todayn.\", \"d433292f-8470-42e4-98a1-eeace1ef06b0\": \"https://www.juedisches-museum-muenchen.de/en/\"}',1,'2023-11-28 10:24:48','2023-11-28 10:24:48','f7c17786-dcec-422c-81d3-353135a1cfbf'),(4752,1103,10,NULL,NULL,NULL,'{\"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"Jüdisches Museum München: Zeugnis jüdischer Geschichte und Kultur\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"Das Jüdische Museum München erzählt die Geschichte der jüdischen Gemeinschaft in München und Bayern. Die Ausstellungen beleuchten die vielfältige Kultur, Traditionen und das wechselhafte Schicksal der jüdischen Bevölkerung. Neben historischen Artefakten werden auch zeitgenössische künstlerische Arbeiten präsentiert, die die Bedeutung der jüdischen Kultur im heutigen München verdeutlichen.\"}',1,'2023-11-28 10:24:48','2023-11-28 10:24:48','c3eb857d-86b0-42aa-a7a6-89b92bd2f2d8'),(4753,1104,9,NULL,NULL,NULL,'{\"1eba02c7-3ca9-4e5e-a0f8-53a781379216\": \"Dienstag bis Sonntag, 11:00 Uhr bis 17:00 Uhr\", \"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"Valentin-Karlstadt-Musäum: Einblick in Münchens Kabarettgeschichte\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"Il Valentin-Karlstadt-Musée è un tributo unico alla storia del cabaret di Monaco. Il museo, che prende il nome dai famosi cabarettisti Karl Valentin e Liesl Karlstadt, offre un\'affascinante visione della loro vita e del loro lavoro. I visitatori possono passeggiare tra mostre umoristiche, oggetti di scena originali e oggetti personali degli artisti. Il Musäum è un ricordo vivo della tradizione satirica di Monaco e mostra come Karl Valentin e Liesl Karlstadt criticassero la società del loro tempo con arguzia e ironia. Una visita promette non solo un arricchimento culturale, ma anche tante risate e divertimento. Immergetevi nel mondo del cabaret bavarese e vivete l\'atmosfera unica del Valentin-Karlstadt-Museum!\", \"d433292f-8470-42e4-98a1-eeace1ef06b0\": \"https://www.valentin-karlstadt-musaeum.de/\"}',1,'2023-11-28 10:24:48','2023-11-28 10:24:48','f575fe1c-5566-4cb2-a998-9adcaffb7ea2'),(4754,1104,7,NULL,NULL,NULL,'{\"1eba02c7-3ca9-4e5e-a0f8-53a781379216\": \"Dienstag bis Sonntag, 11:00 Uhr bis 17:00 Uhr\", \"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"Valentin-Karlstadt-Musäum: Einblick in Münchens Kabarettgeschichte\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"Das Valentin-Karlstadt-Musäum ist eine einzigartige Hommage an die Kabarettgeschichte Münchens. Benannt nach den berühmten Münchner Kabarettisten Karl Valentin und Liesl Karlstadt, bietet das Museum einen faszinierenden Einblick in ihr Leben und Werk. Besucher können durch humorvolle Ausstellungen, Originalrequisiten und persönliche Gegenstände der Künstler schlendern. Das Musäum ist eine lebendige Erinnerung an die satirische Tradition Münchens und zeigt, wie Karl Valentin und Liesl Karlstadt mit Witz und Ironie die Gesellschaft ihrer Zeit kritisierten. Ein Besuch verspricht nicht nur kulturelle Bereicherung, sondern auch jede Menge Lachen und Unterhaltung. Tauchen Sie ein in die Welt des bayerischen Kabaretts und erleben Sie die einzigartige Atmosphäre des Valentin-Karlstadt-Musäums!\", \"d433292f-8470-42e4-98a1-eeace1ef06b0\": \"https://www.valentin-karlstadt-musaeum.de/\"}',1,'2023-11-28 10:24:48','2023-11-28 10:24:48','c856adc8-c2c3-4474-9a4d-9f3045870fe2'),(4755,1104,8,NULL,NULL,NULL,'{\"1eba02c7-3ca9-4e5e-a0f8-53a781379216\": \"Tuesday to Sunday, 11:00 am to 5:00 pm\", \"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"Valentin Karlstadt Museum: Insight into Munich\'s cabaret history\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"cThe Valentin-Karlstadt-Musäum is a unique tribute to Munich\'s cabaret history. Named after the famous Munich cabaret artists Karl Valentin and Liesl Karlstadt, the museum offers a fascinating insight into their lives and work. Visitors can stroll through humorous exhibitions, original props and personal items belonging to the artists. The Musäum is a living reminder of Munich\'s satirical tradition and shows how Karl Valentin and Liesl Karlstadt criticized the society of their time with wit and irony. A visit promises not only cultural enrichment, but also plenty of laughter and entertainment. Immerse yourself in the world of Bavarian cabaret and experience the unique atmosphere of the Valentin-Karlstadt-Musée!\", \"d433292f-8470-42e4-98a1-eeace1ef06b0\": \"https://www.valentin-karlstadt-musaeum.de/\"}',1,'2023-11-28 10:24:48','2023-11-28 10:24:48','8166d33c-a7dc-44b3-9caa-b8f3bf4b40df'),(4756,1104,10,NULL,NULL,NULL,'{\"1eba02c7-3ca9-4e5e-a0f8-53a781379216\": \"Dienstag bis Sonntag, 11:00 Uhr bis 17:00 Uhr\", \"5605656f-e22e-4696-bca0-9d756bd6eb70\": \"Valentin-Karlstadt-Musäum: Einblick in Münchens Kabarettgeschichte\", \"bb94c828-0ca3-4926-a7ce-c8ba3085f138\": \"Das Valentin-Karlstadt-Musäum ist eine einzigartige Hommage an die Kabarettgeschichte Münchens. Benannt nach den berühmten Münchner Kabarettisten Karl Valentin und Liesl Karlstadt, bietet das Museum einen faszinierenden Einblick in ihr Leben und Werk. Besucher können durch humorvolle Ausstellungen, Originalrequisiten und persönliche Gegenstände der Künstler schlendern. Das Musäum ist eine lebendige Erinnerung an die satirische Tradition Münchens und zeigt, wie Karl Valentin und Liesl Karlstadt mit Witz und Ironie die Gesellschaft ihrer Zeit kritisierten. Ein Besuch verspricht nicht nur kulturelle Bereicherung, sondern auch jede Menge Lachen und Unterhaltung. Tauchen Sie ein in die Welt des bayerischen Kabaretts und erleben Sie die einzigartige Atmosphäre des Valentin-Karlstadt-Musäums!\", \"d433292f-8470-42e4-98a1-eeace1ef06b0\": \"https://www.valentin-karlstadt-musaeum.de/\"}',1,'2023-11-28 10:24:48','2023-11-28 10:24:48','56095e60-4d3b-410e-9c6b-cd4c93f5e06d'),(4757,1105,9,NULL,NULL,NULL,'{\"a5f31ac1-d94c-4311-82fa-1ef9ce42f581\": \"Conclusione\", \"fa86aa14-6f7b-40cc-80f3-f615590ffac3\": \"h2\"}',1,'2023-11-28 10:24:48','2023-11-28 10:24:48','009d9a2a-08c4-43e7-948d-8afad584a56d'),(4758,1105,7,NULL,NULL,NULL,'{\"a5f31ac1-d94c-4311-82fa-1ef9ce42f581\": \"Fazit\", \"fa86aa14-6f7b-40cc-80f3-f615590ffac3\": \"h2\"}',1,'2023-11-28 10:24:48','2023-11-28 10:24:48','e425c3c5-6bbb-4d50-b36c-9597fe57e4da'),(4759,1105,8,NULL,NULL,NULL,'{\"a5f31ac1-d94c-4311-82fa-1ef9ce42f581\": \"Conclusion\", \"fa86aa14-6f7b-40cc-80f3-f615590ffac3\": \"h2\"}',1,'2023-11-28 10:24:48','2023-11-28 10:24:48','7c51b477-ce6d-4eb7-bf2d-062b289e75a1'),(4760,1105,10,NULL,NULL,NULL,'{\"a5f31ac1-d94c-4311-82fa-1ef9ce42f581\": \"Fazit\", \"fa86aa14-6f7b-40cc-80f3-f615590ffac3\": \"h2\"}',1,'2023-11-28 10:24:48','2023-11-28 10:24:48','7d961c26-63df-492b-b8f4-48fe13e2ac03'),(4761,1106,9,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"I musei di Monaco offrono un\'impressionante gamma di tesori ed esperienze culturali. Dall\'arte classica, alla tecnologia e al design, fino all\'affascinante mondo della mobilità e della storia ebraica, la metropoli bavarese si presenta come un vero e proprio Eldorado per i visitatori culturalmente interessati. Una visita a un museo di Monaco non è solo un viaggio nel passato, ma anche un viaggio alla scoperta della diversità della creatività e dell\'innovazione umana.\"}',1,'2023-11-28 10:24:48','2023-11-28 10:24:48','c600e350-2e64-459e-9c4b-23476ed81a20'),(4762,1106,7,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"Münchens Museen bieten eine beeindruckende Bandbreite an kulturellen Schätzen und Erlebnissen. Von klassischer Kunst über Technik und Design bis hin zur faszinierenden Welt der Mobilität und der jüdischen Geschichte – die bayerische Metropole präsentiert sich als wahres Eldorado für kulturell interessierte Besucher. Ein Museumsbesuch in München ist nicht nur eine Reise in die Vergangenheit, sondern auch eine Entdeckungsreise durch die Vielfalt der menschlichen Kreativität und Innovation.\"}',1,'2023-11-28 10:24:48','2023-11-28 10:24:48','0665be29-534e-4458-a8ac-8dda2884fdb4'),(4763,1106,8,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"Munich\'s museums offer an impressive range of cultural treasures and experiences. From classical art, technology and design to the fascinating world of mobility and Jewish history - the Bavarian metropolis presents itself as a true Eldorado for culturally interested visitors. A visit to a museum in Munich is not only a journey into the past, but also a voyage of discovery through the diversity of human creativity and innovation.\"}',1,'2023-11-28 10:24:48','2023-11-28 10:24:48','4aacf030-84a7-4abc-8081-e6f784f5a6ce'),(4764,1106,10,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"Münchens Museen bieten eine beeindruckende Bandbreite an kulturellen Schätzen und Erlebnissen. Von klassischer Kunst über Technik und Design bis hin zur faszinierenden Welt der Mobilität und der jüdischen Geschichte – die bayerische Metropole präsentiert sich als wahres Eldorado für kulturell interessierte Besucher. Ein Museumsbesuch in München ist nicht nur eine Reise in die Vergangenheit, sondern auch eine Entdeckungsreise durch die Vielfalt der menschlichen Kreativität und Innovation.\"}',1,'2023-11-28 10:24:48','2023-11-28 10:24:48','f8965b5a-e1d7-4b6d-91f8-746011024962'),(4817,1120,1,'Locations','locations','locations','{\"45faead8-c280-4936-9ddf-3a3ec2d07a52\": true}',0,'2023-11-28 12:46:33','2023-12-03 11:09:54','071ef60b-40b6-4d44-8fc0-9ccadd76c2c1'),(4818,1120,4,'Locations','locations','locations','{\"45faead8-c280-4936-9ddf-3a3ec2d07a52\": true}',0,'2023-11-28 12:46:33','2023-11-28 12:52:41','936638fc-9ba6-459d-b55b-ca8674d7ac25'),(4819,1120,2,'Locations','locations','locations','{\"45faead8-c280-4936-9ddf-3a3ec2d07a52\": true}',0,'2023-11-28 12:46:33','2023-11-28 12:52:41','6dcc9659-4cbc-4a58-9ff9-c2a0408c9551'),(4820,1120,3,'Locations','locations','locations','{\"45faead8-c280-4936-9ddf-3a3ec2d07a52\": true}',0,'2023-11-28 12:46:33','2023-11-28 12:52:41','88bb4db6-4e21-4