エアのギャラリーを歩けば、過去のエコーと、今日のベルリンを特徴づけるたくましい精神を感じることができるだろう。\"}',1,'2023-12-03 10:39:15','2023-12-03 10:39:15','f449a586-df12-4cac-8411-749dd93175c7'),(5278,697,11,NULL,NULL,NULL,'{\"3a0ff308-aab3-40f3-9e76-e651b423ca1c\": \"ベルリンの壁\", \"d2dbe0c8-d8a4-48cc-b4ba-082ee622ac0b\": [\"wide\"]}',1,'2023-12-03 10:39:15','2023-12-03 10:39:15','2b008e6d-2b29-43b6-a4fa-ab62b1605919'),(5279,698,11,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"この街のモダンな活気を味わいたいなら、クロイツベルクを訪れよう。この多彩な文化のるつぼのような地区では、多彩なグルメシーン、トレンディなブティック、盛んなアートシーンが楽しめます。地元の人々がピクニックやライブ音楽に集うゲルリッツァー公園を散策したり、いたるところに飾られた鮮やかなストリートアートに魅了されたり。クロイツベルクは、ベルリンの歴史的な過去と進歩的で先進的な現在がシームレスに融合していることを証明しています。\\n\\n夜には、ベルリンの伝説的なナイトライフを楽しむことができる。ベルクハインのようなテクノの殿堂から、親しみやすいジャズクラブ、歴史あるビアガーデンまで、日が暮れると街は活気づきます。エレクトロニック・ミュージック・シーンの脈打つビートに浸るもよし、居心地のいいバーでクラフトビールを片手にくつろぐもよし、ベルリンのナイトライフは誰もが楽しめるものばかりです。\\n\\n歴史と現代性の二面性を持つベルリンは、ユニークで豊かな旅行体験をお約束します。ベルリンの象徴的なランドマークに魅了される人も、複雑な歴史に興味を持つ人も、モダンな魅力に魅了される人も、ベルリンは、両手を広げて未来を歓迎しながら、過去を受け入れる都市を探検するようあなたを誘います。\"}',1,'2023-12-03 10:39:15','2023-12-03 10:39:15','6ed6ff14-4d2a-4324-b718-a66fdbe45df4'),(5291,4,11,'ホームページ','home','__home__','{\"c1940a37-f8d1-4445-a880-101255bfabe5\": \"ベルリンのシティマガジン、本当に素晴らしい！\"}',1,'2023-12-03 10:39:35','2023-12-03 10:39:35','f7f0967c-8718-4b17-a678-cffd8583bee8'),(5313,139,11,'雑誌','雑誌','雑誌','{\"bd99bd78-f4c9-4e15-83ca-230c2479d384\": false, \"c05ea8a3-0b6b-41f7-87be-c356ee495284\": \"Im Grunewald 18\\n\\nBerlin\"}',1,'2023-12-03 10:40:09','2023-12-03 14:26:17','6bbdb79d-492b-4614-8c14-b62db5707130'),(5314,142,11,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"🎉 文化、革新、歴史が織りなす活気あふれるタペストリーへようこそ。\\n\\n🏙️ __ベルリン - 歴史と現代が出会う場所:__\\n\\n街角のいたるところで豊かな過去の物語がささやかれるベルリンのダイナミックなエネルギーに飛び込んでみませんか。ベルリンを象徴するブランデンブルク門からイーストサイドギャラリーの多彩なストリートアートまで、ベルリンは歴史と前衛的な創造性が難なく融合した都市です。隠された宝石を発見し、多様な地域を探索し、ベルリンを文化万華鏡にする伝統と革新の融合を味わう。\\n\\n\\n🍻 __ミュンヘン - バイエルンのエレガンスとオクトーバーフェストの歓喜:__\\n\\nバイエルンの伝統と現代的な魅力が見事に融合した街、ミュンヘンの豊かなタペストリーに浸ってみませんか。荘厳なニンフェンブルク宮殿やフラウエン教会の象徴的な尖塔など、珠玉の建築物で飾られた魅力的な通りを散策してみましょう。ミュンヘンの活気あふれる文化シーンでは、世界的な美術館や博物館を訪れ、賑やかなビアガーデンや伝統的なビール醸造所では、オクトーバーフェストの心温まる精神に酔いしれましょう。レジデンツのクラシカルなエレガンスに魅了されようとも、ヴィクトゥアリエンマルクトの陽気な雰囲気に飲み込まれようとも、ミュンヘンは歴史と文化、そして人生を謳歌する喜びの調和のとれた共存の証です。洗練された雰囲気と陽気な雰囲気が融合したバイエルンの大都市を旅してみませんか。. 🥨\\n\\n🌊 __ハンブルク - 無限の可能性を秘めた港:__\\n\\nハンブルクは、その海洋精神を両手を広げて受け入れている街です。エルプフィルハーモニーの魅力を発見し、シュパイヒャーシュタットの賑やかなウォーターフロントを散策し、ハンブルクのコスモポリタンな魅力を反映する活気ある地域に身を置く。本誌は、このハンザ同盟の珠玉の海事物語、美食、そして進化し続ける文化的景観をナビゲートするあなたの羅針盤です。\\n\\n🌳 __ソルタウ-ヒースの中の自然の隠れ家:__\\n\\n自然が主役のソルタウの静かな抱擁へ逃避しましょう。リューネブルク・ヒースの魅惑的な風景を探索し、ソルタウ・ヒースランドの豊かな緑の中でくつろぎ、人生のシンプルな楽しみを満喫してください。本誌は、ソルタウを自然への隠れ家とする隠れた魅力、アウトドア・アドベンチャー、静謐な美しさを発見するようあなたを誘います。\\n\\n\\n📖 私たちのページでは、これらの都市の精神を紹介するストーリー、特集、洞察の厳選されたコレクションをご覧いただけます。居住者であれ、好奇心旺盛な旅行者であれ、私たちと一緒に都市の多様なタペストリーを巡る旅に出かけましょう。私たちがこれらの素晴らしいデスティネーションを探索し、祝福し、その鼓動を明らかにするとき、ご乗船を歓迎します！🌍📸 \\n\\n\\\\#CityVibesMagazine #DiscoverBerlinHamburgSoltau\"}',1,'2023-12-03 10:40:09','2024-03-26 11:00:23','260b2a64-1084-4d24-b8ac-77c6869b1faf'),(5315,234,11,'検索','検索','検索','{\"84760a94-cb38-424c-89e3-94ec494bf991\": false}',1,'2023-12-03 10:40:09','2023-12-03 14:27:02','feb9d0b1-18d9-46f1-a6f8-0749423cdc5b'),(5316,302,11,'トピックス','トピックス','トピックス','{\"1be82713-a59c-499a-83b6-f3bfcb21c646\": true}',1,'2023-12-03 10:40:09','2023-12-03 14:26:40','3a97bcbb-0a8b-4f25-9bac-b8718562e9ad'),(5317,348,11,'記事','記事','記事','{\"130dff67-c8fe-4e57-bd48-4275a86b9c11\": true}',1,'2023-12-03 10:40:09','2023-12-03 14:26:30','cc61c005-1e4e-45f2-8560-46cf6ae6cec5'),(5323,1120,11,'所在地','所在地','所在地','{\"45faead8-c280-4936-9ddf-3a3ec2d07a52\": true}',0,'2023-12-03 10:40:09','2023-12-03 14:26:51','840e606e-d2dd-418b-9cdd-116872412171'),(5348,1,11,'Site Info - Global Settings','site-info-global-settings',NULL,'{\"0b7b855c-3f2f-4d39-8ef0-e5fccd7a2685\": \"シティマグ\", \"c544e80e-5800-4486-82be-1c01d88af25f\": true, \"c5b5269f-b571-4e25-af4c-6cdfdc2fbf56\": \"Perlen vor die Säue GmbH\"}',1,'2023-12-03 10:41:00','2023-12-03 10:41:00','72d919ae-2f1d-4a29-a730-187fb48794fe'),(5510,671,11,NULL,NULL,NULL,'{\"87b7fc79-7