'289252fd-cf88-4af3-bedc-bc3efc83bbc6'),(6100,1305,10,'פסיפס מינכן: מסורת, תרבות והרוח מחממת הלב של החגיגה','פסיפס-מינכן-מסורת-תרבות-והרוח-מחממת-הלב-של-החגיגה','articles/פסיפס-מינכן-מסורת-תרבות-והרוח-מחממת-הלב-של-החגיגה','{\"af872e03-1253-4002-8d19-6dae768135a3\": true}',1,'2023-12-03 14:40:35','2023-12-03 14:40:35','a7fb2dce-747d-48df-865f-5395dcb13b76'),(6101,1305,7,'Münchner Mosaik: Tradition, Kultur und der herzerwärmende Geist des Feierns','muenchner-mosaik-tradition-kultur-und-der-herzerwaermende-geist-des-feierns','artikel/muenchner-mosaik-tradition-kultur-und-der-herzerwaermende-geist-des-feierns','{\"af872e03-1253-4002-8d19-6dae768135a3\": true}',1,'2023-12-03 14:40:35','2023-12-03 14:40:35','a31c2d5a-bf1c-42e7-93e3-75966ecd78cb'),(6102,1305,8,'Munich Mosaic: Tradition, Culture, and the Heartwarming Spirit of Celebration','munich-mosaic-tradition-culture-and-the-heartwarming-spirit-of-celebration','articles/munich-mosaic-tradition-culture-and-the-heartwarming-spirit-of-celebration','{\"af872e03-1253-4002-8d19-6dae768135a3\": true}',1,'2023-12-03 14:40:35','2023-12-03 14:40:35','89daf307-4665-43c9-b001-bf49c658cb62'),(6103,1305,9,'Mosaico di Monaco di Baviera: tradizione, cultura e lo spirito di festa che scalda il cuore','mosaico-di-monaco-di-baviera-tradizione-cultura-e-lo-spirito-di-festa-che-scalda-il-cuore','articoli/mosaico-di-monaco-di-baviera-tradizione-cultura-e-lo-spirito-di-festa-che-scalda-il-cuore','{\"af872e03-1253-4002-8d19-6dae768135a3\": true}',1,'2023-12-03 14:40:35','2023-12-03 14:40:35','8c8f103a-5b09-428c-92d9-3a2cc3ef6b95'),(6104,1306,10,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"פסיפס מינכן: מסורת, תרבות ורוח החגיגה מחממת הלב שוכנת בלב בוואריה, מינכן ניצבת כתכשיט תרבותי, השוזרת יחד מסורות בנות מאות שנים עם תוסס עכשווי ששובה את המקומיים והמבקרים כאחד. מהארכיטקטורה האיקונית שלה ועד לגני הבירה התוססים, מינכן מציעה שילוב ייחודי של היסטוריה, תרבות והילולה חגיגית.\\n\\nקו הרקיע של מינכן הוא עדות להיסטוריה העשירה שלה ולמחויבותה לשימור המורשת האדריכלית. ארמון נימפנבורג המפואר, עם חזיתות הרוקוקו והגנים השופעים שלו, מעביר את המבקרים לעידן של מלכות בוואריה. הצריחים הנישאים של פראואנקירכה שולטים בנוף העירוני, ומסמלים אמונה וחוסן כאחד. לשוטט ברחובותיה המקסימים של העיר, כאשר כל פינה מספרת סיפור של אלגנטיות ופאר בווארית.\\n\\nמינכן מתהדרת בסצנה תרבותית המתחרה במיטב באירופה. חובבי אמנות יכולים לאבד את עצמם ב-Alte Pinakothek, ביתם של יצירות מופת של אנשים כמו אלברכט דירר ורמברנדט. ה-Pinacotek der Moderne, לעומת זאת, חובק אמנות עכשווית על כל צורותיה. התיאטראות ואולמות הקונצרטים של העיר, כולל התיאטרון הלאומי הנודע והגסטייג, מציגים הצגות שנעות בין יצירות מופת קלאסיות להפקות אוונגרד.\"}',1,'2023-12-03 14:40:35','2023-12-03 14:40:35','4a9e2ac1-e8e5-4025-87a2-40d0e24cc037'),(6105,1306,7,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"Im Herzen Bayerns gelegen, ist München ein kulturelles Juwel, das jahrhundertealte Traditionen nahtlos mit einer modernen Lebendigkeit verbindet, die Einheimische und Besucher gleichermaßen in ihren Bann zieht. Von der ikonischen Architektur bis hin zu den lebhaften Biergärten bietet München eine einzigartige Mischung aus Geschichte, Kultur und festlicher Ausgelassenheit.\\n\\nMünchens Skyline ist ein Zeugnis seiner reichen Geschichte und seines Engagements für die Bewahrung des architektonischen Erbes. Das prächtige Schloss Nymphenburg mit seinen Rokokofassaden und üppigen Gärten versetzt die Besucher in die Zeit der bayerischen Könige. Die hoch aufragenden Türme der Frauenkirche dominieren das Stadtbild und symbolisieren sowohl Glauben als auch Widerstandskraft. Schlendern Sie durch die charmanten Straßen der Stadt, wo jede Ecke eine Geschichte von bayerischer Eleganz und Pracht erzählt.\\n\\nMünchen hat eine Kulturszene, die sich mit den besten Europas messen kann. Kunstliebhaber können sich in der Alten Pinakothek verlieren, die Meisterwerke von Albrecht Dürer und Rembrandt beherbergt. Die Pinakothek der Moderne hingegen widmet sich der zeitgenössischen Kunst in all ihren Formen. Die Theater und Konzerthäuser der Stadt, darunter das renommierte Nationaltheater und der Gasteig, zeigen Aufführungen, die von klassischen Meisterwerken bis hin zu Avantgarde-Produktionen reichen.\"}',1,'2023-12-03 14:40:35','2023-12-03 14:40:35','caaacb58-1f96-4cc9-bf02-95676de081d7'),(6106,1306,8,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"Nestled in the heart of Bavaria, Munich stands as a cultural jewel, seamlessly weaving together centuries-old traditions with a contemporary vibrancy that captivates both locals and visitors alike. From its iconic architecture to the lively beer gardens, Munich offers a unique blend of history, culture, and festive revelry.\\n\\nMunich\'s skyline is a testament to its rich history and commitment to preserving architectural heritage. The resplendent Nymphenburg Palace, with its rococo facades and lush gardens, transports visitors to an era of Bavarian royalty. The towering spires of Frauenkirche dominate the cityscape, symbolizing both faith and resilience. Wander through the city\'s charming streets, where each corner tells a story of Bavarian elegance and grandeur.\\n\\nMunich boasts a cultural scene that rivals the best in Europe. Art enthusiasts can lose themselves in the Alte Pinakothek, home to masterpieces by the likes of Albrecht Dürer and Rembrandt. The Pinakothek der Moderne, on the other hand, embraces contemporary art in all its forms. The city\'s theaters and concert halls, including the renowned National Theatre and the Gasteig, showcase performances that range from classical masterpieces to avant-garde productions.\"}',1,'2023-12-03 14:40:35','2023-12-03 14:40:35','87fbe622-3c45-471f-afb8-3b5c3fa8390c'),(6107,1306,9,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"Situata nel cuore della Baviera, Monaco di Baviera è un gioiello culturale che intreccia perfettamente tradizioni secolari con una vivacità contemporanea che affascina sia gli abitanti che i visitatori. Dalla sua architettura iconica alle vivaci birrerie all\'aperto, Monaco offre una miscela unica di storia, cultura e festa.\\n\\nLo skyline di Monaco di Baviera è una testimonianza della sua ricca storia e del suo impegno nel preservare il patrimonio architettonico. Lo splendido Palazzo di Nymphenburg, con le sue facciate rococò e i suoi giardini lussureggianti, trasporta i visitatori in un\'epoca di regalità bavarese. Le guglie svettanti della Frauenkirche dominano il paesaggio urbano, simboleggiando sia la fede che la resistenza. Passeggiate per le affascinanti strade della città, dove ogni angolo racconta una storia di eleganza e grandezza bavarese.\\n\\nMonaco vanta una scena culturale che rivaleggia con le migliori d\'Europa. Gli appassionati d\'arte possono perdersi nella Alte Pinakothek, che ospita capolavori di Albrecht Dürer e Rembrandt. La Pinakothek der Moderne, invece, abbraccia l\'arte contemporanea in tutte le sue forme. I teatri e le sale da concerto della città, tra cui il rinomato Teatro Nazionale e il Gasteig, ospitano spettacoli che spaziano dai capolavori classici alle produzioni d\'avanguardia.\"}',1,'2023-12-03 14:40:35','2023-12-03 14:40:35','aaa1cbad-012f-4bcd-8d27-d92bc73070fe'),(6108,1307,10,NULL,NULL,NULL,'{\"3a0ff308-aab3-40f3-9e76-e651b423ca1c\": \"ארמון נימפנבורג\", \"d2dbe0c8-d8a4-48cc-b4ba-082ee622ac0b\": [\"wide\"]}',1,'2023-12-03 14:40:35','2023-12-03 14:40:35','89035067-5cae-4c84-83a2-2c19244b5ada'),(6109,1307,7,NULL,NULL,NULL,'{\"3a0ff308-aab3-40f3-9e76-e651b423ca1c\": \"Schloß Nymphenburg\", \"d2dbe0c8-d8a4-48cc-b4ba-082ee622ac0b\": [\"wide\"]}',1,'2023-12-03 14:40:35','2023-12-03 14:40:35','514f4cc1-3262-4e90-a14e-d749bcb15986'),(6110,1307,8,NULL,NULL,NULL,'{\"3a0ff308-aab3-40f3-9e76-e651b423ca1c\": \"Nymphenburg Palace\", \"d2dbe0c8-d8a4-48cc-b4ba-082ee622ac0b\": [\"wide\"]}',1,'2023-12-03 14:40:35','2023-12-03 14:40:35','e20b8bfd-cf18-42b3-95df-e772e170caaa'),(6111,1307,9,NULL,NULL,NULL,'{\"3a0ff308-aab3-40f3-9e76-e651b423ca1c\": \"Palazzo di Nymphenburg\", \"d2dbe0c8-d8a4-48cc-b4ba-082ee622ac0b\": [\"wide\"]}',1,'2023-12-03 14:40:35','2023-12-03 14:40:35','60dbffaf-dcc9-4808-bc9b-4532f7cb358e'),(6112,1308,10,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"מינכן היא שם נרדף לאוקטוברפסט, פסטיבל הפולקספסט הגדול בעולם שמושך אליו מיליוני מבקרים מדי שנה. העיר הופכת לחגיגה תוססת של התרבות הבווארית, עם מוזיקה מסורתית, מטבח טעים וכמובן, הבירה הטובה ביותר. מעבר לאוקטוברפסט, גני הבירה של מינכן כמו Hofbräuhaus המפורסם מציעים טעם אותנטי של מבשלות מקומיות ואווירה נעימה המגדירה את אורח החיים הבווארי.\\n\\nהנוף הקולינרי של מינכן הוא הרפתקה גסטרונומית, עם מאכלים בוואריים מסורתיים משלימים השפעות בינלאומיות. מהנקניקיות הלבביות של Viktualienmarkt ועד למסעדות בעלות כוכבי מישלן, העיר נותנת מענה לחיך מגוונים. אל תפספסו את ההזדמנות להתענג על בייגלה או להתפנק עם פרוסה מענגת של אפפלסטרודל תוך כדי סיור בעיר.\\n\\nבמינכן, העבר וההווה מתלכדים ויוצרים אווירה קסומה ודינמית כאחד. בין אם אתם מטיילים בכיכרות היסטוריות, שוקעים באוצרות תרבות, או מגדלת סטיין בגן בירה סואן, מינכן מזמינה אתכם לחוות את השילוב ההרמוני של מסורת, תרבות ועידוד חגיגי. הצטרפו אלינו כשאנו חוקרים את פינותיו של השטיח הבווארי הזה, שבו כל רגע הוא חגיגה של הפיתוי הנצחי של מינכן. פרוסט! :beers:\"}',1,'2023-12-03 14:40:35','2023-12-03 14:40:35','0a832c48-ea66-49d2-9b45-0dbf1f0cd0d0'),(6113,1308,7,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"München ist ein Synonym für das Oktoberfest, das größte Volksfest der Welt, das jedes Jahr Millionen von Besuchern anlockt. Die Stadt verwandelt sich in ein lebendiges Fest der bayerischen Kultur, mit traditioneller Musik, köstlicher Küche und natürlich dem besten Bier. Über das Oktoberfest hinaus bieten Münchens Biergärten wie das berühmte Hofbräuhaus eine authentische Verkostung der einheimischen Biere und eine gesellige Atmosphäre, die die bayerische Lebensart ausmacht.\\n\\nDie kulinarische Landschaft Münchens ist ein gastronomisches Abenteuer, bei dem traditionelle bayerische Gerichte durch internationale Einflüsse ergänzt werden. Von den deftigen Würstchen auf dem Viktualienmarkt bis hin zu den Michelin-Sternerestaurants bietet die Stadt alles, was das Herz begehrt. Verpassen Sie nicht die Gelegenheit, eine Brezn zu probieren oder sich ein Stück Apfelstrudel zu gönnen, während Sie die Stadt erkunden.\\n\\nIn München verschmelzen Vergangenheit und Gegenwart und schaffen eine Atmosphäre, die sowohl bezaubernd als auch dynamisch ist. Ob Sie über historische Plätze schlendern, in kulturelle Schätze eintauchen oder in einem belebten Biergarten einen Krug heben - München lädt Sie ein, die harmonische Mischung aus Tradition, Kultur und festlicher Stimmung zu erleben. Begleiten Sie uns, wenn wir die Ecken und Winkel dieses bayerischen Wandteppichs erkunden, wo jeder Moment ein Fest des zeitlosen Reizes Münchens ist. Prost! :beers:\"}',1,'2023-12-03 14:40:36','2023-12-03 14:40:36','c6b15180-e1ce-4df0-9ba3-5516f207f4f6'),(6114,1308,8,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"Munich is synonymous with Oktoberfest, the world\'s largest Volksfest that attracts millions of visitors every year. The city transforms into a lively celebration of Bavarian culture, complete with traditional music, delicious cuisine, and of course, the finest beer. Beyond Oktoberfest, Munich\'s beer gardens like the famous Hofbräuhaus offer an authentic taste of local brews and a convivial atmosphere that defines the Bavarian way of life.\\n\\nMunich\'s culinary landscape is a gastronomic adventure, with traditional Bavarian fare complemented by international influences. From the hearty sausages of Viktualienmarkt to the Michelin-starred restaurants, the city caters to diverse palates. Don\'t miss the chance to savor a pretzel or indulge in a delectable slice of Apfelstrudel while exploring the city.\\n\\nIn Munich, the past and present coalesce, creating an atmosphere that is both enchanting and dynamic. Whether you\'re strolling through historic squares, immersing yourself in cultural treasures, or raising a stein in a bustling beer garden, Munich invites you to experience the harmonious blend of tradition, culture, and festive cheer. Join us as we explore the nooks and crannies of this Bavarian tapestry, where each moment is a celebration of Munich\'s timeless allure. Prost! :beers:\"}',1,'2023-12-03 14:40:36','2023-12-03 14:40:36','e6d31c68-285e-4634-8140-1a2195abe278'),(6115,1308,9,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"Monaco di Baviera è sinonimo di Oktoberfest, la più grande festa popolare del mondo che attira ogni anno milioni di visitatori. La città si trasforma in una vivace celebrazione della cultura bavarese, con musica tradizionale, cucina deliziosa e, naturalmente, la migliore birra. Oltre all\'Oktoberfest, le birrerie all\'aperto di Monaco, come la famosa Hofbräuhaus, offrono un assaggio autentico delle birre locali e un\'atmosfera conviviale che definisce lo stile di vita bavarese.\\n\\nIl paesaggio culinario di Monaco è un\'avventura gastronomica, con piatti tradizionali bavaresi integrati da influenze internazionali. Dalle sostanziose salsicce del Viktualienmarkt ai ristoranti stellati Michelin, la città si rivolge a palati diversi. Non perdete l\'occasione di assaporare un pretzel o di concedervi una deliziosa fetta di Apfelstrudel mentre esplorate la città.\\n\\nA Monaco di Baviera, passato e presente si fondono, creando un\'atmosfera incantevole e dinamica. Che si tratti di passeggiare per le piazze storiche, di immergersi nei tesori culturali o di innalzare uno stein in una vivace birreria all\'aperto, Monaco vi invita a sperimentare l\'armoniosa miscela di tradizione, cultura e allegria festosa. Unitevi a noi per esplorare gli angoli e le fessure di questo arazzo bavarese, dove ogni momento è una celebrazione del fascino senza tempo di Monaco. Prost! :beers:\"}',1,'2023-12-03 14:40:36','2023-12-03 14:40:36','1e574d59-ee02-403b-b402-3fb31249b2f7'),(6116,1309,10,NULL,NULL,NULL,'{\"3a0ff308-aab3-40f3-9e76-e651b423ca1c\": \"המרכז הישראלי מינכן\", \"d2dbe0c8-d8a4-48cc-b4ba-082ee622ac0b\": [\"wide\"]}',1,'2023-12-03 14:40:36','2023-12-03 14:40:36','35f2710e-e286-4ddb-96c2-d2c7ac71125f'),(6117,1309,7,NULL,NULL,NULL,'{\"3a0ff308-aab3-40f3-9e76-e651b423ca1c\": \"Israelisches Zentrum München\", \"d2dbe0c8-d8a4-48cc-b4ba-082ee622ac0b\": [\"wide\"]}',1,'2023-12-03 14:40:36','2023-12-03 14:40:36','6638fc9f-efb0-4704-aae3-9b24c8f9eb15'),(6118,1309,8,NULL,NULL,NULL,'{\"3a0ff308-aab3-40f3-9e76-e651b423ca1c\": \"Israeli Center Munich\", \"d2dbe0c8-d8a4-48cc-b4ba-082ee622ac0b\": [\"wide\"]}',1,'2023-12-03 14:40:36','2023-12-03 14:40:36','ac0d0c55-d7bd-49b8-89b8-c48b2e4b77bc'),(6119,1309,9,NULL,NULL,NULL,'{\"3a0ff308-aab3-40f3-9e76-e651b423ca1c\": \"Centro israelitico di Monaco\", \"d2dbe0c8-d8a4-48cc-b4ba-082ee622ac0b\": [\"wide\"]}',1,'2023-12-03 14:40:36','2023-12-03 14:40:36','c9515c97-8663-46a9-b0f6-ec48d75b023e'),(6120,1310,10,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"בית הכנסת במינכן, תכשיט ארכיטקטוני באמצע בירת בוואריה, זוהר כסמל לקהילה היהודית ולמורשת התרבותית שלה. בית הכנסת נחנך בשנת 2006 ומרשים באסתטיקה המודרנית שלו, אשר בכל זאת נטועה עמוק בהיסטוריה ובמסורת. הבניין, שתוכנן על ידי האדריכלים הנודעים ונדל חופר לורך + הירש, משלב בהרמוניה אלמנטים של יהדות עם עיצוב עכשווי. הקווים הנקיים והשקיפות של חזית הזכוכית יוצרים אווירה מסבירת פנים המזמינה את המבקרים לגלות את ההיסטוריה העשירה וההווה התוסס של התרבות היהודית.\\n\\nבית הכנסת הוא לא רק מרכז דתי, אלא גם מקום מפגש וחילופים בין-תרבותיים. הקהילה מארגנת באופן קבוע אירועים, הרצאות ופעילויות תרבות המפגישות אנשים מרקעים שונים. למבקרים יש הזדמנות לערוך סיורים מודרכים כדי ללמוד עוד על ההיסטוריה של הקהילה היהודית במינכן ולחוות את חשיבותו של בית הכנסת כמקום של תפילה, חינוך ודיאלוג. בית הכנסת במינכן הוא לא רק יצירת מופת אדריכלית, אלא גם עדות חיה לגיוון ולפתיחות של העיר.\"}',1,'2023-12-03 14:40:36','2023-12-03 14:40:36','e7292a28-78dd-4d0d-a643-71d5215037d7'),(6121,1310,7,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"Die Münchener Synagoge, ein architektonisches Juwel inmitten der bayerischen Hauptstadt, erstrahlt als Symbol der jüdischen Gemeinschaft und ihres kulturellen Erbes. Die Synagoge wurde im Jahr 2006 eingeweiht und beeindruckt durch ihre moderne Ästhetik, die dennoch tief in der Geschichte und Tradition verwurzelt ist. Das Gebäude, entworfen von den renommierten Architekten Wandel Hoefer Lorch + Hirsch, verbindet harmonisch Elemente des Judentums mit zeitgenössischem Design. Die klaren Linien und die Transparenz der Glasfassade schaffen eine einladende Atmosphäre, die Besucher dazu einlädt, die reiche Geschichte und die lebendige Gegenwart der jüdischen Kultur zu entdecken.\\n\\nDie Synagoge ist nicht nur ein religiöses Zentrum, sondern auch ein Ort der Begegnung und des interkulturellen Austauschs. Die Gemeinde organisiert regelmäßig Veranstaltungen, Vorträge und kulturelle Aktivitäten, die Menschen unterschiedlicher Hintergründe zusammenbringen. Besucher haben die Möglichkeit, an Führungen teilzunehmen, um mehr über die Geschichte der jüdischen Gemeinschaft in München zu erfahren und die Bedeutung der Synagoge als Ort des Gebets, der Bildung und des Dialogs zu erleben. Die Münchener Synagoge ist somit nicht nur ein architektonisches Meisterwerk, sondern auch ein lebendiges Zeugnis für die Vielfalt und Offenheit der Stadt.\"}',1,'2023-12-03 14:40:36','2023-12-03 14:40:36','9fc2242d-1691-4292-bb05-ced2c462defa'),(6122,1310,8,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"The Munich Synagogue, an architectural jewel in the heart of the Bavarian capital, shines as a symbol of the Jewish community and its cultural heritage. The synagogue was inaugurated in 2006 and impresses with its modern aesthetics, which are nevertheless deeply rooted in history and tradition. The building, designed by renowned architects Wandel Hoefer Lorch + Hirsch, harmoniously combines elements of Judaism with contemporary design. The clean lines and transparency of the glass façade create an inviting atmosphere that invites visitors to discover the rich history and vibrant present of Jewish culture.\\n\\nThe synagogue is not only a religious center, but also a place of encounter and intercultural exchange. The community regularly organizes events, lectures and cultural activities that bring people from different backgrounds together. Visitors have the opportunity to take part in guided tours to learn more about the history of the Jewish community in Munich and experience the importance of the synagogue as a place of prayer, education and dialog. The Munich Synagogue is therefore not only an architectural masterpiece, but also a living testimony to the diversity and openness of the city.\"}',1,'2023-12-03 14:40:36','2023-12-03 14:40:36','9b7c8598-093c-45a1-b1c6-12ad1de08edb'),(6123,1310,9,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"La Sinagoga di Monaco, gioiello architettonico nel centro della capitale bavarese, brilla come simbolo della comunità ebraica e del suo patrimonio culturale. Inaugurata nel 2006, la sinagoga colpisce per la sua estetica moderna, ma profondamente radicata nella storia e nella tradizione. L\'edificio, progettato dai famosi architetti Wandel Hoefer Lorch + Hirsch, combina armoniosamente elementi dell\'ebraismo con il design contemporaneo. Le linee pulite e la trasparenza della facciata in vetro creano un\'atmosfera invitante che invita i visitatori a scoprire la ricca storia e il vibrante presente della cultura ebraica.\\n\\nLa sinagoga non è solo un centro religioso, ma anche un luogo di incontro e scambio interculturale. La comunità organizza regolarmente eventi, conferenze e attività culturali che riuniscono persone di diversa provenienza. I visitatori hanno la possibilità di partecipare a visite guidate per conoscere meglio la storia della comunità ebraica di Monaco e sperimentare l\'importanza della sinagoga come luogo di preghiera, educazione e dialogo. La Sinagoga di Monaco non è quindi solo un capolavoro architettonico, ma anche una testimonianza vivente della diversità e dell\'apertura della città.\"}',1,'2023-12-03 14:40:36','2023-12-03 14:40:36','f52be29d-8103-4f65-89c7-17735a407d4e'),(6134,23,12,'Example 59',NULL,NULL,'{\"210d9fa3-32b0-47ac-a970-3859d419f4c1\": \"tbd.\", \"f7c71e3b-41bf-46f6-920c-4605371cc48e\": \"tbd.\"}',1,'2023-12-03 15:10:44','2023-12-03 15:10:44','179cc1c3-2de4-4216-bee1-477b75a4b4fe'),(6136,25,12,'Example 61',NULL,NULL,'{\"210d9fa3-32b0-47ac-a970-3859d419f4c1\": \"tbd.\", \"f7c71e3b-41bf-46f6-920c-4605371cc48e\": \"tbd.\"}',1,'2023-12-03 15:10:44','2023-12-03 15:10:44','0302f6be-f009-4a8f-b182-bb02e62515cf'),(6138,31,12,'Example 10',NULL,NULL,'{\"210d9fa3-32b0-47ac-a970-3859d419f4c1\": \"tbd.\", \"f7c71e3b-41bf-46f6-920c-4605371cc48e\": \"tbd.\"}',1,'2023-12-03 15:10:44','2023-12-03 15:10:44','115a85f3-16da-4408-ba03-8b5fe6feb73f'),(6139,104,12,'Example 12',NULL,NULL,'{\"210d9fa3-32b0-47ac-a970-3859d419f4c1\": \"tbd.\", \"f7c71e3b-41bf-46f6-920c-4605371cc48e\": \"tbd.\"}',1,'2023-12-03 15:10:44','2023-12-03 15:10:44','4bd594ad-8e00-4182-a3b9-c06be4dc1d82'),(6142,140,12,'Example 8',NULL,NULL,'{\"210d9fa3-32b0-47ac-a970-3859d419f4c1\": \"tbd.\", \"f7c71e3b-41bf-46f6-920c-4605371cc48e\": \"tbd.\"}',1,'2023-12-03 15:10:44','2023-12-03 15:10:44','b29a3116-8cee-4d70-8abe-a103bc89b2f5'),(6143,150,12,'Example 3',NULL,NULL,'{\"210d9fa3-32b0-47ac-a970-3859d419f4c1\": \"tbd.\", \"f7c71e3b-41bf-46f6-920c-4605371cc48e\": \"tbd.\"}',1,'2023-12-03 15:10:44','2023-12-03 15:10:44','f8578c59-a6ca-47b8-8734-226af5638a29'),(6144,186,12,'Example 10',NULL,NULL,'{\"210d9fa3-32b0-47ac-a970-3859d419f4c1\": \"tbd.\", \"f7c71e3b-41bf-46f6-920c-4605371cc48e\": \"tbd.\"}',1,'2023-12-03 15:10:44','2023-12-03 15:10:44','bb9593ba-3bba-4aa6-a4ae-5169d4d436f0'),(6146,268,12,'Login',NULL,NULL,'{\"210d9fa3-32b0-47ac-a970-3859d419f4c1\": \"tbd.\", \"f7c71e3b-41bf-46f6-920c-4605371cc48e\": \"Internet\"}',1,'2023-12-03 15:10:44','