nenatis faucibus. Curabitur suscipit suscipit tellus. Etiam feugiat lorem non metus.\\n\\nProin magna. Sed mollis, eros et ultrices tempus, mauris ipsum aliquam libero, non adipiscing dolor urna a orci. Donec id justo. Praesent porttitor, nulla vitae posuere iaculis, arcu nisl dignissim dolor, a pretium mi sem ut ipsum. Proin faucibus arcu quis ante.\"}',1,'2023-12-03 15:11:38','2023-12-03 15:11:38','f08714f2-dd2a-4b70-ba98-5a0f280f2c24'),(6202,423,12,NULL,NULL,NULL,'{\"3c11856d-7122-4296-b607-943240ccc31e\": \"Evrenin sonsuz genişliğinde, önemli değil\", \"d64e2481-fc99-4ef5-9e2b-f2153f5d9d20\": \"Bavyera bilgeliği, Schleißheim Saray Parkı\'ndaki park bankı\"}',1,'2023-12-03 15:11:38','2023-12-03 15:11:38','36204fab-7ec0-4e2c-9290-c3cfa59cb1f9'),(6203,496,12,NULL,NULL,NULL,'{\"d2dbe0c8-d8a4-48cc-b4ba-082ee622ac0b\": []}',1,'2023-12-03 15:11:38','2023-12-03 15:11:38','b8faac9c-c9a1-4f9d-a1a1-bf1f59abfd0c'),(6204,620,12,'Berlin\'i keşfedin: Tarih ve modernliğin senfonisi','berlini-kesfedin-tarih-ve-modernligin-senfonisi','mkaleler/berlini-kesfedin-tarih-ve-modernligin-senfonisi','{\"af872e03-1253-4002-8d19-6dae768135a3\": true}',1,'2023-12-03 15:11:39','2023-12-03 15:18:48','b363a72c-221b-4520-ad87-c7e8a203479d'),(6205,624,12,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"Almanya\'nın canlı başkenti Berlin, sokaklarında dolaşacak kadar şanslı olan tüm gezginleri büyüleyen modern, dinamik bir enerjiyle zengin bir tarihi zahmetsizce harmanlıyor. Çalkantılı bir geçmişin ardından Berlin, dayanıklılığı, çeşitliliği ve yaratıcılığı kutlayan bir şehre dönüşmüştür. Tarihi simge yapılardan canlı ve popüler mahallelere kadar Berlin, unutulmaz bir yolculuk vaat eden büyüleyici bir destinasyondur.\\n\\nKeşfinize Almanya\'nın yeniden birleşmesinin sembolü olan Brandenburg Kapısı\'ndan başlayın. Bu görkemli neoklasik anıt şehrin kalbinde gururla durmakta ve müzeler, saraylar ve büyüleyici kafelerle kaplı tarihi bir bulvar olan Unter den Linden\'e açılan kapıyı oluşturmaktadır. Brandenburg Kapısı\'nda günün farklı saatlerinde dolaşın ve dönüştürücü güzelliğini deneyimleyin - gün doğumunun sıcak ışığında veya gece gökyüzünün ışığında, huşu duygusu uyandırmakta asla başarısız olmaz.\\n\\nDünyanın dört bir yanından sanatçıların yüzü aşkın duvar resmiyle süslenmiş Berlin Duvarı\'nın yaşayan bir bölümü olan Doğu Yakası Galerisi\'ni ziyaret ederek kendinizi Berlin\'in karmaşık tarihine bırakın. Her bir duvar resmi, bir zamanlar bölünmüş olan bir şehrin umutlarını, mücadelelerini ve zaferlerini yansıtan kendi hikayesini anlatıyor. Bu açık hava galerisinde yürürken, geçmişin yankılarını ve bugün Berlin\'i karakterize eden dirençli ruhu hissedeceksiniz.\"}',1,'2023-12-03 15:11:39','2023-12-03 15:11:39','735dd44a-39a1-43e9-af9b-c0c44c454477'),(6206,697,12,NULL,NULL,NULL,'{\"3a0ff308-aab3-40f3-9e76-e651b423ca1c\": \"Berlin Duvarı\", \"d2dbe0c8-d8a4-48cc-b4ba-082ee622ac0b\": [\"wide\"]}',1,'2023-12-03 15:11:39','2023-12-03 15:11:39','371fe754-f6a6-4260-b0f1-56249ad3618f'),(6207,698,12,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"Şehrin modern canlılığını tatmak istiyorsanız Kreuzberg\'i ziyaret edin. Bu eklektik mahalle, farklı bir mutfak ortamı, son moda butikler ve gelişen bir sanat ortamı sunan bir kültürler eritme potasıdır. Yerel halkın piknik ve canlı müzik için bir araya geldiği Görlitzer Park\'ı keşfedin veya her köşeyi süsleyen canlı sokak sanatı karşısında büyülenin. Kreuzberg, Berlin\'in tarihi geçmişi ile ilerici ve ileri görüşlü bugününü kusursuz bir şekilde harmanlama becerisinin bir kanıtıdır.\\n\\nAkşamları Berlin\'in efsanevi gece hayatının tadını çıkarabilirsiniz. Berghain gibi tekno tapınaklarından samimi caz kulüplerine ve tarihi bira bahçelerine kadar şehir hava karardıktan sonra canlanır. Kendinizi elektronik müzik sahnesinin titreşen ritmine bırakın ya da elinizde bir birayla rahat bir barda dinlenin - Berlin\'in gece hayatı herkes için bir şeyler sunar.\\n\\nBerlin, tarih ve modernlik ikilemiyle benzersiz ve zenginleştirici bir seyahat deneyimi vaat ediyor. İster şehrin ikonik simgelerinden büyülenmiş, ister karmaşık tarihiyle ilgileniyor ya da modern cazibesiyle büyülenmiş olun, Berlin sizi geçmişini kucaklarken geleceği kollarını açarak karşılayan bir şehri keşfetmeye davet ediyor.\"}',1,'2023-12-03 15:11:39','2023-12-03 15:11:39','60f5fc95-62aa-44cb-be78-ebbf78f3676c'),(6267,139,12,'Bizim Dergimiz','bizim-dergimiz','bizim-dergimiz','{\"bd99bd78-f4c9-4e15-83ca-230c2479d384\": false, \"c05ea8a3-0b6b-41f7-87be-c356ee495284\": \"Im Grunewald 18\\n\\nBerlin\"}',1,'2023-12-03 15:12:26','2023-12-03 21:07:24','65753b3f-91fc-47d0-84a2-5f99b7e05584'),(6268,142,12,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"🎉 Welcome to the vibrant tapestry of culture, innovation, and history that is at the heart of our city magazine, capturing the essence of remarkable German destinations.\\n\\n🏙️ __Berlin - Tarihin Moderniteyle Buluştuğu Yer:__\\n\\nHer sokak köşesinin zengin bir geçmişin hikâyelerini fısıldadığı Berlin\'in dinamik enerjisine dalın. İkonik Brandenburg Kapısı\'ndan East Side Gallery\'nin eklektik sokak sanatına kadar Berlin, tarihi avangart yaratıcılıkla zahmetsizce birleştiren bir şehirdir. Gizli mücevherleri ortaya çıkarın, farklı mahalleleri keşfedin ve Berlin\'i kültürel bir kaleydoskop yapan gelenek ve yeniliğin karışımının tadını çıkarın.\\n\\n\\n🍻 __Münih - Bavyera Şıklığı ve Oktoberfest Şenliği:__\\n\\nBavyera geleneğini modern cazibeyle zahmetsizce harmanlayan bir şehir olan Münih\'in zengin dokusuna kendinizi bırakın. Nymphenburg Sarayı\'nın ihtişamı ve Frauenkirche\'nin ikonik kuleleri gibi mimari mücevherlerle bezenmiş büyüleyici sokaklarda dolaşın. Münih\'in canlı kültürel ortamı sizi birinci sınıf müzeleri keşfetmeye davet ederken, hareketli bira bahçeleri ve geleneksel bira imalathaneleri sizi Oktoberfest\'in iç açıcı ruhunu yaşamaya çağırıyor. İster Residenz\'in klasik zarafetiyle büyülenmiş olun, ister Viktualienmarkt\'ın neşeli atmosferine kendinizi kaptırın, Münih tarihin, kültürün ve hayatın neşeli kutlamalarının uyumlu bir şekilde bir arada var olduğunun kanıtıdır. Her anı sofistike ve eğlencenin keyifli bir karışımı olan bu Bavyera metropolünde bir yolculuğa çıkarken bize katılın. 🥨\\n\\n🌊 __Hamburg - Sonsuz Olasılıklar Limanı:__\\n\\nDenizcilik ruhunu kollarını açarak kucaklayan Hamburg\'a yelken açın. Elbphilharmonie\'nin cazibesini keşfedin, Speicherstadt\'ın hareketli sahilinde dolaşın ve Hamburg\'un kozmopolit cazibesini yansıtan canlı mahallelerde kendinizi kaybedin. Dergimiz, bu Hansa mücevherinin denizcilik hikayeleri, gastronomik lezzetleri ve sürekli gelişen kültürel manzarasında gezinmeniz için pusulanızdır.\\n\\n🌳 __Soltau - Doğanın Cenneti Heath\'te:__\\n\\nDoğanın ön plana çıktığı Soltau\'nun huzurlu kucağına kaçın. Lüneburg Heath\'in büyüleyici manzaralarını keşfedin, Soltau Heathland\'in gür yeşilliklerinde gevşeyin ve hayatın basit zevklerinin tadını çıkarın. Dergimiz sizi, Soltau\'yu doğada inzivaya çekilmek isteyenler için bir cennet haline getiren gizli cevherleri, açık hava maceralarını ve sakin güzelliği keşfetmeye davet ediyor.\\n\\n\\n📖 Sayfalarımızda, bu şehirlerin ruhunu sergileyen hikayeler, özellikler ve içgörülerden oluşan seçilmiş bir koleksiyon bulacaksınız. İster bir sakin ister meraklı bir ziyaretçi olun, şehirlerin çeşitli dokularında bir yolculukta bize katılın. Bu inanılmaz destinasyonların nabzını keşfederken, kutlarken ve ortaya çıkarırken gemiye hoş geldiniz! 🌍📸 \\n\\n\\\\#CityVibesMagazine #DiscoverBerlinHamburgSoltau\"}',1,'2023-12-03 15:12:26','2024-03-26 11:00:23','b7d6be95-98bc-4bea-9b38-c2e0584436e6'),(6269,234,12,'Arama','search','search','{\"84760a94-cb38-424c-89e3-94ec494bf991\": false}',1,'2023-12-03 15:12:26','2023-12-03 15:19:44','2fa513f4-a85f-4bb4-bc24-fbb1a288db04'),(6270,302,12,'Konular','konular','konular','{\"1be82713-a59c-499a-83b6-f3bfcb21c646\": true}',1,'2023-12-03 15:12:26','2023-12-03 21:08:00','33f818d6-9ae4-4ab7-92bb-9bd11d640c