ンス-ベルリン-歴史と現代性のシンフォニー','{\"af872e03-1253-4002-8d19-6dae768135a3\": true}',1,'2023-12-03 15:17:11','2023-12-03 15:17:11','559bed8c-d6e8-4670-b711-99e799dbb090'),(6388,1325,12,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"Almanya\'nın canlı başkenti Berlin, sokaklarında dolaşacak kadar şanslı olan tüm gezginleri büyüleyen modern, dinamik bir enerjiyle zengin bir tarihi zahmetsizce harmanlıyor. Çalkantılı bir geçmişin ardından Berlin, dayanıklılığı, çeşitliliği ve yaratıcılığı kutlayan bir şehre dönüşmüştür. Tarihi simge yapılardan canlı ve popüler mahallelere kadar Berlin, unutulmaz bir yolculuk vaat eden büyüleyici bir destinasyondur.\\n\\nKeşfinize Almanya\'nın yeniden birleşmesinin sembolü olan Brandenburg Kapısı\'ndan başlayın. Bu görkemli neoklasik anıt şehrin kalbinde gururla durmakta ve müzeler, saraylar ve büyüleyici kafelerle kaplı tarihi bir bulvar olan Unter den Linden\'e açılan kapıyı oluşturmaktadır. Brandenburg Kapısı\'nda günün farklı saatlerinde dolaşın ve dönüştürücü güzelliğini deneyimleyin - gün doğumunun sıcak ışığında veya gece gökyüzünün ışığında, huşu duygusu uyandırmakta asla başarısız olmaz.\\n\\nDünyanın dört bir yanından sanatçıların yüzü aşkın duvar resmiyle süslenmiş Berlin Duvarı\'nın yaşayan bir bölümü olan Doğu Yakası Galerisi\'ni ziyaret ederek kendinizi Berlin\'in karmaşık tarihine bırakın. Her bir duvar resmi, bir zamanlar bölünmüş olan bir şehrin umutlarını, mücadelelerini ve zaferlerini yansıtan kendi hikayesini anlatıyor. Bu açık hava galerisinde yürürken, geçmişin yankılarını ve bugün Berlin\'i karakterize eden dirençli ruhu hissedeceksiniz.\"}',1,'2023-12-03 15:17:11','2023-12-03 15:17:11','fafed475-769d-48c2-92d7-1ef775aa79bc'),(6389,1325,1,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"Berlin, the vibrant capital of Germany, effortlessly blends a rich tapestry of history with a modern, dynamic energy that captivates every traveler lucky enough to wander its streets. Steeped in a tumultuous past, Berlin has emerged as a city that celebrates resilience, diversity, and creativity. From iconic historical landmarks to trendy neighborhoods pulsating with life, Berlin is a captivating destination that promises an unforgettable journey.\\n\\nBegin your exploration at the iconic Brandenburg Gate, an enduring symbol of German reunification. This majestic neoclassical monument stands proudly at the heart of the city, providing a gateway to Unter den Linden, a historic boulevard lined with museums, palaces, and charming cafes. Wander through the Brandenburg Gate at different times of the day to witness its transformative beauty – bathed in the warm glow of sunrise or illuminated against the night sky, it never fails to evoke a sense of awe.\\n\\nDelve into Berlin\'s complex history with a visit to the East Side Gallery, a vibrant stretch of the Berlin Wall adorned with over a hundred murals by artists from around the world. Each mural tells a unique story, reflecting the hope, struggles, and triumphs of a city that once stood divided. As you stroll along this open-air gallery, you\'ll feel the echoes of the past and the resilient spirit that now defines Berlin.\"}',1,'2023-12-03 15:17:11','2023-12-03 15:17:11','1231c952-76a6-4017-a778-41309df90ad5'),(6390,1325,2,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"Berlin, die pulsierende Hauptstadt Deutschlands, verbindet mühelos eine reiche Geschichte mit einer modernen, dynamischen Energie, die jeden Reisenden, der das Glück hat, durch ihre Straßen zu wandern, in ihren Bann zieht. Nach einer turbulenten Vergangenheit hat sich Berlin zu einer Stadt entwickelt, die Widerstandsfähigkeit, Vielfalt und Kreativität zelebriert. Von historischen Wahrzeichen bis hin zu pulsierenden Szenevierteln ist Berlin ein fesselndes Reiseziel, das eine unvergessliche Reise verspricht.\\n\\nBeginnen Sie Ihre Erkundungstour am Brandenburger Tor, dem Wahrzeichen der deutschen Wiedervereinigung. Dieses majestätische neoklassizistische Monument steht stolz im Herzen der Stadt und bildet das Tor zu Unter den Linden, einem historischen Boulevard, der von Museen, Palästen und charmanten Cafés gesäumt ist. Schlendern Sie zu verschiedenen Tageszeiten durch das Brandenburger Tor und erleben Sie seine verwandelnde Schönheit - im warmen Licht des Sonnenaufgangs oder im Licht des Nachthimmels erweckt es immer wieder ein Gefühl der Ehrfurcht.\\n\\nTauchen Sie in die komplexe Geschichte Berlins ein, indem Sie die East Side Gallery besuchen, einen lebendigen Abschnitt der Berliner Mauer, der mit über hundert Wandmalereien von Künstlern aus aller Welt geschmückt ist. Jedes Wandbild erzählt eine eigene Geschichte und spiegelt die Hoffnung, die Kämpfe und die Triumphe einer Stadt wider, die einst geteilt war. Bei einem Spaziergang durch diese Open-Air-Galerie werden Sie das Echo der Vergangenheit und den unverwüstlichen Geist spüren, der Berlin heute prägt.\"}',1,'2023-12-03 15:17:11','2023-12-03 15:17:11','db91e0c9-a1ba-4270-9e95-7c74af029481'),(6391,1325,11,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"活気あふれるドイツの首都ベルリンは、豊かな歴史とモダンでダイナミックなエネルギーが見事に融合し、その通りを歩き回る幸運な旅行者を魅了する。激動の過去を経て、ベルリンは回復力、多様性、創造性を称える都市へと進化した。歴史的なランドマークから活気あふれるトレンディな地区まで、ベルリンは忘れられない旅を約束する魅惑的な目的地です。\\n\\nドイツ統一のシンボル、ブランデンブルク門から探検を始めましょう。この壮大なネオクラシック様式のモニュメントは、街の中心に堂々と建ち、博物館や宮殿、魅力的なカフェが並ぶ歴史的な大通り、ウンター・デン・リンデンへの玄関口となっています。ブランデンブルク門は、朝日や夜空の暖かい光に照らされ、畏敬の念を抱かずにはいられません。\\n\\n世界中のアーティストによる100以上の壁画で飾られたベルリンの壁の生きた部分であるイーストサイド・ギャラリーを訪れて、ベルリンの複雑な歴史に浸ってください。それぞれの壁画は独自の物語を語り、かつて分断された街の希望、闘争、勝利を映し出している。このオープンエアのギャラリーを歩けば、過去のエコーと、今日のベルリンを特徴づけるたくましい精神を感じることができるだろう。\"}',1,'2023-12-03 15:17:11','2023-12-03 15:17:11','c3432585-03fa-4c5d-9448-890be104fe52'),(6392,1326,12,NULL,NULL,NULL,'{\"3a0ff308-aab3-40f3-9e76-e651b423ca1c\": \"Berlin Duvarı\", \"d2dbe0c8-d8a4-48cc-b4ba-082ee622ac0b\": [\"wide\"]}',1,'2023-12-03 15:17:11','2023-12-03 15:17:11','18ea6252-4122-429c-a2a0-9a936974d26a'),(6393,1326,1,NULL,NULL,NULL,'{\"3a0ff308-aab3-40f3-9e76-e651b423ca1c\": \"Berliner Mauer\", \"d2dbe0c8-d8a4-48cc-b4ba-082ee622ac0b\": [\"wide\"]}',1,'2023-12-03 15:17:11','2023-12-03 15:17:11','e16eafe3-3a22-4c59-b59b-41aaf725b356'),(6394,1326,2,NULL,NULL,NULL,'{\"3a0ff308-aab3-40f3-9e76-e651b423ca1c\": \"Berliner Mauer\", \"d2dbe0c8-d8a4-48cc-b4ba-082ee622ac0b\": [\"wide\"]}',1,'2023-12-03 15:17:11','2023-12-03 15:17:11','f7aa4d78-4a3a-495a-a05b-504075f018a2'),(6395,1326,11,NULL,NULL,NULL,'{\"3a0ff308-aab3-40f3-9e76-e651b423ca1c\": \"ベルリンの壁\", \"d2dbe0c8-d8a4-48cc-b4ba-082ee622ac0b\": [\"wide\"]}',1,'2023-12-03 15:17:11','2023-12-03 15:17:11','b189de8d-78bd-4100-b812-9af6bd202ace'),(6396,1327,12,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"Şehrin modern canlılığını tatmak istiyorsanız Kreuzberg\'i ziyaret edin. Bu eklektik mahalle, farklı bir mutfak ortamı, son moda butikler ve gelişen bir sanat ortamı sunan bir kültürler eritme potasıdır. Yerel halkın piknik ve canlı müzik için bir araya geldiği Görlitzer Park\'ı keşfedin veya her köşeyi süsleyen canlı sokak sanatı karşısında büyülenin. Kreuzberg, Berlin\'in tarihi geçmişi ile ilerici ve ileri görüşlü bugününü kusursuz bir şekilde harmanlama becerisinin bir kanıtıdır.\\n\\nAkşamları Berlin\'in efsanevi gece hayatının tadını çıkarabilirsiniz. Berghain gibi tekno tapınaklarından samimi caz kulüplerine ve tarihi bira bahçelerine kadar şehir hava karardıktan sonra canlanır. Kendinizi elektronik müzik sahnesinin titreşen ritmine bırakın ya da elinizde bir birayla rahat bir barda dinlenin - Berlin\'in gece hayatı herkes için bir şeyler sunar.\\n\\nBerlin, tarih ve modernlik ikilemiyle benzersiz ve zenginleştirici bir seyahat deneyimi vaat ediyor. İster şehrin ikonik simgelerinden büyülenmiş, ister karmaşık tarihiyle ilgileniyor ya da modern cazibesiyle büyülenmiş olun, Berlin sizi geçmişini kucaklarken geleceği kollarını açarak karşılayan bir şehri keşfetmeye davet ediyor.\"}',1,'2023-12-03 15:17:11','2023-12-03 15:17:11','4c7e66b6-4ccb-49fc-8b2b-e3d6089989fc'),(6397,1327,1,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"For a taste of the city\'s modern vibrancy, head to Kreuzberg. This eclectic neighborhood is a melting pot of cultures, boasting a diverse culinary scene, trendy boutiques, and a thriving arts community. Explore Görlitzer Park, where locals gather to enjoy picnics and live music, or lose yourself in the vibrant street art that adorns every corner. Kreuzberg is a testament to Berlin\'s ability to seamlessly blend its storied past with a progressive, forward-thinking present.\\n\\nIn the evening, savor Berlin\'s legendary nightlife. From techno temples like Berghain to intimate jazz clubs and historic beer gardens, the city comes alive after dark. Immerse yourself in the pulsating beats of the electronic music scene or unwind in a cozy bar with a craft beer in hand – Berlin\'s nightlife caters to every taste.\\n\\nBerlin, with its dichotomy of history and modernity, promises a unique and enriching travel experience. Whether you\'re captivated by its iconic landmarks, intrigued by its complex history, or enchanted by its contemporary charm, Berlin invites you to explore a city that has embraced its past while embracing the future with open arms.\"}',1,'2023-12-03 15:17:11','2023-12-03 15:17:11','f0500b30-0361-4e1f-aba7-91d132e2f74c'),(6398,1327,2,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"Wenn Sie einen Vorgeschmack auf die moderne Lebendigkeit der Stadt haben möchten, besuchen Sie Kreuzberg. Dieser eklektische Bezirk ist ein Schmelztiegel der Kulturen, der eine vielfältige kulinarische Szene, trendige Boutiquen und eine blühende Kunstszene zu bieten hat. Erkunden Sie den Görlitzer Park, wo sich die Einheimischen zum Picknick und zu Live-Musik treffen, oder lassen Sie sich von der lebendigen Straßenkunst verzaubern, die jede Ecke ziert. Kreuzberg ist ein Beweis für die Fähigkeit Berlins, seine geschichtsträchtige Vergangenheit nahtlos mit einer fortschrittlichen, zukunftsorientierten Gegenwart zu verbinden.\\n\\nAm Abend können Sie das legendäre Berliner Nachtleben genießen. Von Techno-Tempeln wie dem Berghain bis hin zu intimen Jazzclubs und historischen Biergärten erwacht die Stadt nach Einbruch der Dunkelheit zum Leben. Tauchen Sie ein in die pulsierenden Beats der elektronischen Musikszene oder entspannen Sie sich in einer gemütlichen Bar mit einem Craft Beer in der Hand - das Berliner Nachtleben bietet für jeden Geschmack etwas.\\n\\nBerlin, mit seiner Dichotomie aus Geschichte und Moderne, verspricht eine einzigartige und bereichernde Reiseerfahrung. Ganz gleich, ob Sie von den ikonischen Wahrzeichen der Stadt fasziniert sind, sich für ihre komplexe Geschichte interessieren oder sich von ihrem modernen Charme verzaubern lassen - Berlin lädt Sie ein, eine Stadt zu erkunden, die sich ihrer Vergangenheit stellt und gleichzeitig die Zukunft mit offenen Armen empfängt.\"}',1,'2023-12-03 15:17:11','2023-12-03 15:17:11','ab49358c-c21b-4e90-b7c6-2c9136b9bdbd'),(6399,1327,11,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"この街のモダンな活気を味わいたいなら、クロイツベルクを訪れよう。この多彩な文化のるつぼのような地区では、多彩なグルメシーン、トレンディなブティック、盛んなアートシーンが楽しめます。地元の人々がピクニックやライブ音楽に集うゲルリッツァー公園を散策したり、いたるところに飾られた鮮やかなストリートアートに魅了されたり。クロイツベルクは、ベルリンの歴史的な過去と進歩的で先進的な現在がシームレスに融合していることを証明しています。\\n\\n夜には、ベルリンの伝説的なナイトライフを楽しむことができる。ベルクハインのようなテクノの殿堂から、親しみやすいジャズクラブ、歴史あるビアガーデンまで、日が暮れると街は活気づきます。エレクトロニック・ミュージック・シーンの脈打つビートに浸るもよし、居心地のいいバーでクラフトビールを片手にくつろぐもよし、ベルリンのナイトライフは誰もが楽しめるものばかりです。\\n\\n歴史と現代性の二面性を持つベルリンは、ユニークで豊かな旅行体験をお約束します。ベルリンの象徴的なランドマークに魅了される人も、複雑な歴史に興味を持つ人も、モダンな魅力に魅了される人も、ベルリンは、両手を広げて未来を歓迎しながら、過去を受け入れる都市を探検するようあなたを誘います。\"}',1,'2023-12-03 15:17:12','2023-12-03 15:17:12','31cb47fd-0d56-4dfe-a1c4-254eed8d8f44'),(6543,671,12,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"Şehre kısa bir giriş\"}',1,'2023-12-03 21:09:02','2023-12-03 21:09:02','4062e1fa-cecc-4471-97cd-57f891947c9f'),(6544,629,12,'Giriş','giris','konular/giris',NULL,1,'2023-12-03 21:09:04','2023-12-03 21:09:43','7f19cd10-696a-493a-