bcc89cef\": \"🎉 欢迎阅读我们城市杂志的核心内容--充满活力的文化、创新和历史织锦，捕捉德国非凡旅游胜地的精髓。\\n\\n🏙️ __柏林--历史与现代的交汇:__\\n\\n感受柏林的活力，这里的每个街角都在诉说着丰富的历史。从标志性的勃兰登堡门到东区画廊（East Side Gallery）不拘一格的街头艺术，柏林是一座毫不费力地将历史与前卫创意完美结合的城市。发掘隐藏的瑰宝，探索不同的街区，品味传统与创新的融合，让柏林成为一个文化万花筒。\\n\\n\\n🍻 __慕尼黑--巴伐利亚的优雅与啤酒节的狂欢:__\\n\\n慕尼黑是一座将巴伐利亚传统与现代魅力完美融合的城市。在迷人的街道上漫步，您会发现许多建筑瑰宝，如雄伟的宁芬堡宫（Nymphenburg Palace）和圣母教堂（Frauenkirche）的标志性尖塔。慕尼黑充满活力的文化氛围邀请您探索世界一流的博物馆，而热闹的啤酒花园和传统酿酒厂则召唤您沉浸在啤酒节的温馨氛围中。无论您是被宫殿（Residenz）的古典优雅所吸引，还是沉浸在维多利亚市场（Viktualienmarkt）的欢乐气氛中，慕尼黑都是历史、文化与欢乐生活和谐共存的见证。让我们一起踏上这座巴伐利亚大都市的旅程，感受精致与狂欢的完美融合。 🥨\\n\\n🌊 __汉堡--充满无限可能的港湾:__\\n\\n启航前往汉堡，一座张开双臂拥抱海洋精神的城市。探索爱尔柏菲尔音乐厅的魅力，漫步于繁华的斯派克大街滨水区，沉醉于体现汉堡国际大都会魅力的充满活力的街区。我们的杂志是您的指南针，带您领略这块汉萨瑰宝的海洋故事、美食佳肴和不断发展的文化景观。\\n\\n🌳 __索尔陶--荒野中的自然天堂:__\\n\\n逃离索尔陶宁静的怀抱，让大自然成为您的中心。探索吕内堡石楠林的迷人风光，在索尔陶石楠林的郁郁葱葱中放松身心，尽情享受简单的生活乐趣。我们的杂志诚邀您来发现隐藏的宝藏、户外探险和宁静之美，让索尔陶成为寻求大自然静谧的人们的天堂。\\n\\n\\n📖 在我们的网页上，您将看到一系列经过精心策划的故事、特写和见解，它们展示了这些城市的精神。无论您是当地居民还是好奇的游客，都可以加入我们的旅程，领略这些城市丰富多彩的面貌。欢迎加入我们的行列，一起探索、庆祝和发现这些令人难以置信的目的地的脉搏！ 🌍📸 \\n\\n\\\\#CityVibesMagazine #DiscoverBerlinHamburgSoltau\"}',1,'2023-12-03 21:44:51','2024-03-26 11:00:23','16db8126-4ad6-4a9d-80cd-b0560c48ffdc'),(6908,234,13,'搜索','sou-suo','sou-suo','{\"84760a94-cb38-424c-89e3-94ec494bf991\": false}',1,'2023-12-03 21:44:51','2023-12-03 21:54:58','4597f664-a3a0-4853-a3ce-424fd061ed80'),(6909,302,13,'主题','zhu-ti','zhu-ti','{\"1be82713-a59c-499a-83b6-f3bfcb21c646\": true}',1,'2023-12-03 21:44:51','2023-12-03 21:54:38','89bcd8f1-3f22-4428-94d9-000f16079b4f'),(6910,348,13,'文章','wen-zhang','wen-zhang','{\"130dff67-c8fe-4e57-bd48-4275a86b9c11\": true}',1,'2023-12-03 21:44:51','2023-12-03 21:54:19','8736d60b-61e2-48da-9081-69e8b795f252'),(6911,1120,13,'地点','di-dian','di-dian','{\"45faead8-c280-4936-9ddf-3a3ec2d07a52\": true}',1,'2023-12-03 21:44:51','2023-12-03 21:54:48','d5b0107f-729b-4047-b486-33ef5a9e05b4'),(6972,1,13,'Site Info - Global Settings','site-info-global-settings',NULL,'{\"0b7b855c-3f2f-4d39-8ef0-e5fccd7a2685\": \"城市杂志\", \"c544e80e-5800-4486-82be-1c01d88af25f\"