2-03 21:54:59','2023-12-03 21:54:59','d7368996-c5b7-452d-8b1c-cfdd2b68bfeb'),(7234,1413,13,'欢迎来到汉堡','huan-ying-lai-dao-yi-bao','articles/huan-ying-lai-dao-yi-bao','{\"af872e03-1253-4002-8d19-6dae768135a3\": false}',1,'2023-12-03 21:55:34','2023-12-03 21:55:34','6c596089-1cf8-4367-aeac-66cd4fc03c74'),(7235,1413,3,'Welcome to Hamburg','welcome-to-hamburg','articles/welcome-to-hamburg','{\"af872e03-1253-4002-8d19-6dae768135a3\": false}',1,'2023-12-03 21:55:34','2023-12-03 21:55:34','70902473-e216-4a39-b6e7-d4ce247e559d'),(7236,1413,4,'Willkommen in Hamburg','willkommen-in-hamburg','beitraege/willkommen-in-hamburg','{\"af872e03-1253-4002-8d19-6dae768135a3\": false}',1,'2023-12-03 21:55:34','2023-12-03 21:55:34','d8e8419f-19de-4c0c-80e9-aaadd7c0d71f'),(7237,1414,13,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"汉堡坐落在德国北部易北河畔，是一座充满活力、历史悠久的大都市，以其丰富的海洋遗产和现代都市魅力向游客招手。作为德国第二大城市和主要港口，汉堡长期以来一直是举足轻重的经济和文化中心。从世界上最大的仓库群 Speicherstadt 的中世纪魅力，到海港城 HafenCity 区的时尚现代，汉堡的城市景观由各种建筑风格的折衷组合而成，展现了汉堡几个世纪以来的动态演变。熙熙攘攘的港口活动造就了这座城市的国际大都会氛围，吸引着多元化的人口，并培养了全球视野，这一点在其生机勃勃的文化氛围和美食中可见一斑。\\n\\n汉堡的文化织锦由一系列博物馆、剧院和音乐场所编织而成，是艺术爱好者和音乐爱好者的天堂。标志性的爱尔柏菲尔音乐厅（Elbphilharmonie）是一座现代杰作，坐落在一座旧仓库之上，是这座城市致力于将传统与创新相结合的见证。除了丰富的文化内涵，汉堡的绿地，如广阔的植物公园和风景如画的阿尔斯特湖，也为居民和游客提供了在这个充满活力的城市中心宁静休憩的场所。无论是探访历史悠久的地标建筑，还是在熙熙攘攘的集市上品尝当地美食，抑或是沿着风景如画的运河游览，汉堡都将古老魅力与现代活力完美融合。\"}',1,'2023-12-03 21:55:34','2023-12-03 21:55:34','4a6f4821-00f6-401d-ad35-0981d7dd30c7'),(7238,1414,3,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"Nestled along the banks of the Elbe River in northern Germany, Hamburg stands as a vibrant and historic metropolis, beckoning visitors with its rich maritime heritage and contemporary urban allure. As the country\'s second-largest city and its principal port, Hamburg has long been a pivotal economic and cultural hub. The cityscape is defined by an eclectic mix of architectural styles, from the medieval charm of the Speicherstadt, the world\'s largest warehouse complex, to the sleek modernity of the HafenCity district, showcasing the dynamic evolution of Hamburg over the centuries. The bustling port activities contribute to the city\'s cosmopolitan atmosphere, attracting a diverse population and fostering a global perspective that is evident in its lively cultural scene and gastronomic offerings.\\n\\nHamburg\'s cultural tapestry is woven with an array of museums, theaters, and music venues, making it a haven for art enthusiasts and music lovers alike. The iconic Elbphilharmonie, a modern masterpiece perched atop an old warehouse, stands as a testament to the city\'s commitment to blending tradition with innovation. Beyond its cultural richness, Hamburg\'s green spaces, such as the expansive Planten un Blomen park and the picturesque Alster Lake, provide residents and visitors alike with tranquil retreats within the heart of this dynamic urban landscape. Whether exploring historic landmarks, savoring local delicacies in the bustling markets, or cruising along the picturesque canals, Hamburg beckons with a unique blend of old-world charm and contemporary vibrancy.\"}',1,'2023-12-03 21:55:34','2023-12-03 21:55:34','a21c7430-e5ac-44b8-bd10-920afd8edbed'),(7239,1414,4,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"An den Ufern der Elbe in Norddeutschland gelegen, ist Hamburg eine pulsierende und historische Metropole, die Besucher mit ihrem reichen maritimen Erbe und ihrem modernen urbanen Charme anzieht. Als zweitgrößte Stadt des Landes und wichtigster Hafen ist Hamburg seit langem ein wichtiger wirtschaftlicher und kultureller Knotenpunkt. Das Stadtbild wird von einem eklektischen Mix aus verschiedenen architektonischen Stilen geprägt, vom mittelalterlichen Charme der Speicherstadt, dem größten Lagerhauskomplex der Welt, bis hin zur eleganten Modernität der HafenCity, die die dynamische Entwicklung Hamburgs im Laufe der Jahrhunderte widerspiegelt. Die geschäftigen Hafenaktivitäten tragen zur kosmopolitischen Atmosphäre der Stadt bei, die eine vielfältige Bevölkerung anzieht und eine globale Perspektive fördert, die sich in der lebendigen Kulturszene und dem gastronomischen Angebot widerspiegelt.\\n\\nHamburgs kultureller Teppich ist mit einer Vielzahl von Museen, Theatern und Musikveranstaltungen gespickt, was die Stadt zu einem Paradies für Kunst- und Musikliebhaber macht. Die ikonische Elbphilharmonie, ein modernes Meisterwerk, das auf einem alten Lagerhaus thront, ist ein Zeugnis für das Engagement der Stadt, Tradition und Innovation zu verbinden. Neben dem kulturellen Reichtum bieten Hamburgs Grünflächen, wie der weitläufige Park Planten un Blomen und die malerische Alster, Einwohnern und Besuchern gleichermaßen ruhige Rückzugsorte inmitten dieser dynamischen Stadtlandschaft. Ob bei der Erkundung historischer Wahrzeichen, beim Genuss lokaler Köstlichkeiten auf den belebten Märkten oder bei einer Schifffahrt auf den malerischen Kanälen - Hamburg lockt mit einer einzigartigen Mischung aus altem Charme und moderner Lebendigkeit.\"}',1,'2023-12-03 21:55:34','2023-12-03 21:55:34','5cac1abf-a97c-43aa-a9dc-9dcb29d017ce'),(7291,671,13,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"城市简介\"}',1,'2023-12-03 22:17:29','2023-12-03 22:17:29','4ba98fe3-eba0-458d-8c90-264851785be1'),(7292,629,13,'导言','dao-yan','topics/dao-yan',NULL,1,'2023-12-03 22:17:31','2023-12-03 22:19:44','af072e8e-9e59-4240-9eff-8a78dd382b3c'),(7328,310,13,NULL,NULL,NULL,'{\"87b7fc79-7099-457b-a3c0-e27fbcc89cef\": \"仅供演示\"}',1,'2023-12-03 22:17:46','2023-12-03 22:17:46','5bb3705f-0793-469d-8582-8a6fab2f2ffc'),(7329,272,13,'演示','yan-shi','topics/yan-shi',NULL,1,'2023-12-03 22:17:47','2023-12-03 22:20:01','73d9cdb1-ae36-4433-bbbf-dbdcdffdb2fd'),(7376,1426,13,'导言','dao-yan','topics/dao-yan',NULL,1,'2023-12-03 22:19:44','2023-12-03 22:19:44','f57401d0-d3ba-4f68-a474-60695a21b7ac'),(7377,1426,1,'Introduction','introduction','topics/introduction',NULL,1,'2023-12-03 22:19:44','2023-12-03 22:19:44','108dbbb3-60c0-449a-9398-7cb3cf119976'),(7378