ne verwandelnde schoenheit im warmen licht des sonnenaufgangs oder im licht des nachthimmels erweckt es immer wieder ein gefuehl der ehrfurcht tauchen sie in die komplexe geschichte berlins ein indem sie die east side gallery besuchen einen lebendigen abschnitt der berliner mauer der mit ueber hundert wandmalereien von kuenstlern aus aller welt geschmueckt ist jedes wandbild erzaehlt eine eigene geschichte und spiegelt die hoffnung die kaempfe und die triumphe einer stadt wider die einst geteilt war bei einem spaziergang durch diese open air galerie werden sie das echo der vergangenheit und den unverwuestlichen geist spueren der berlin heute praegt berliner mauer wenn sie einen vorgeschmack auf die moderne lebendigkeit der stadt haben moechten besuchen sie kreuzberg dieser eklektische bezirk ist ein schmelztiegel der kulturen der eine vielfaeltige kulinarische szene trendige boutiquen und eine bluehende kunstszene zu bieten hat erkunden sie den goerlitzer park wo sich die einheimischen zum picknick und zu live musik treffen oder lassen sie sich von der lebendigen strassenkunst verzaubern die jede ecke ziert kreuzberg ist ein beweis fuer die faehigkeit berlins seine geschichtstraechtige vergangenheit nahtlos mit einer fortschrittlichen zukunftsorientierten gegenwart zu verbinden am abend koennen sie das legendaere berliner nachtleben geniessen von techno tempeln wie dem berghain bis hin zu intimen jazzclubs und historischen biergaerten erwacht die stadt nach einbruch der dunkelheit zum leben tauchen sie ein in die pulsierenden beats der elektronischen musikszene oder entspannen sie sich in einer gemuetlichen bar mit einem craft beer in der hand das berliner nachtleben bietet fuer jeden geschmack etwas berlin mit seiner dichotomie aus geschichte und moderne verspricht eine einzigartige und bereichernde reiseerfahrung ganz gleich ob sie von den ikonischen wahrzeichen der stadt fasziniert sind sich fuer ihre komplexe geschichte interessieren oder sich von ihrem modernen charme verzaubern lassen berlin laedt sie ein eine stadt zu erkunden die sich ihrer vergangenheit stellt und gleichzeitig die zukunft mit offenen armen empfaengt '),(620,'field',2,11,' 活気あふれるドイツの首都ベルリンは、豊かな歴史とモダンでダイナミックなエネルギーが見事に融合し、その通りを歩き回る幸運な旅行者を魅了する。激動の過去を経て、ベルリンは回復力、多様性、創造性を称える都市へと進化した。歴史的なランドマークから活気あふれるトレンディな地区まで、ベルリンは忘れられない旅を約束する魅惑的な目的地です。 ドイツ統一のシンボル、ブランデンブルク門から探検を始めましょう。この壮大なネオクラシック様式のモニュメントは、街の中心に堂々と建ち、博物館や宮殿、魅力的なカフェが並ぶ歴史的な大通り、ウンター・デン・リンデンへの玄関口となっています。ブランデンブルク門は、朝日や夜空の暖かい光に照らされ、畏敬の念を抱かずにはいられません。 世界中のアーティストによる100以上の壁画で飾られたベルリンの壁の生きた部分であるイーストサイド・ギャラリーを訪れて、ベルリンの複雑な歴史に浸ってください。それぞれの壁画は独自の物語を語り、かつて分断された街の希望、闘争、勝利を映し出している。このオープンエアのギャラリーを歩けば、過去のエコーと、今日のベルリンを特徴づけるたくましい精神を感じることができるだろう。 ベルリンの壁 この街のモダンな活気を味わいたいなら、クロイツベルクを訪れよう。この多彩な文化のるつぼのような地区では、多彩なグルメシーン、トレンディなブティック、盛んなアートシーンが楽しめます。地CNYの人々がピクニックやライブ音楽に集うゲルリッツァー公園を散策したり、いたるところに飾られた鮮やかなストリートアートに魅了されたり。クロイツベルクは、ベルリンの歴史的な過去と進歩的で先進的な現在がシームレスに融合していることを証明しています。 夜には、ベルリンの伝説的なナイトライフを楽しむことができる。ベルクハインのようなテクノの殿堂から、親しみやすいジャズクラブ、歴史あるビアガーデンまで、日が暮れると街は活気づきます。エレクトロニック・ミュージック・シーンの脈打つビートに浸るもよし、居心地のいいバーでクラフトビールを片手にくつろぐもよし、ベルリンのナイトライフは誰もが楽しめるものばかりです。 歴史と現代性の二面性を持つベルリンは、ユニークで豊かな旅行体験をお約束します。ベルリンの象徴的なランドマークに魅了される人も、複雑な歴史に興味を持つ人も、モダンな魅力に魅了される人も、ベルリンは、両手を広げて未来を歓迎しながら、過去を受け入れる都市を探検するようあなたを誘います。 '),(620,'field',2,12,' almanyanin canli baskenti berlin sokaklarinda dolasacak kadar sansli olan tum gezginleri buyuleyen modern dinamik bir enerjiyle zengin bir tarihi zahmetsizce harmanliyor calkantili bir gecmisin ardindan berlin dayanikliligi cesitliligi ve yaraticiligi kutlayan bir sehre donusmustur tarihi simge yapilardan canli ve populer mahallelere kadar berlin unutulmaz bir yolculuk vaat eden buyuleyici bir destinasyondur kesfinize almanyanin yeniden birlesmesinin sembolu olan brandenburg kapisindan baslayin bu gorkemli neoklasik anit sehrin kalbinde gururla durmakta ve muzeler saraylar ve buyuleyici kafelerle kapli tarihi bir bulvar olan unter den lindee acilan kapiyi olusturmaktadir brandenburg kapisinda gunun farkli saatlerinde dolasin ve donusturucu guzelligini deneyimleyin gun dogumunun sicak isiginda veya gece gokyuzunun isiginda husu duygusu uyandirmakta asla basarisiz olmaz dunyanin dort bir yanindan sanatcilarin yuzu askin duvar resmiyle suslenmis berlin duvarinin yasayan bir bolumu olan dogu yakasi galerisini ziyaret ederek kendinizi berliin karmasik tarihine birakin her bir duvar resmi bir zamanlar bolunmus olan bir sehrin umutlarini mucadelelerini ve zaferlerini yansitan kendi hikayesini anlatiyor bu acik hava galerisinde yururken gecmisin yankilarini ve bugun berlii karakterize eden direncli ruhu hissedeceksiniz berlin duvari sehrin modern canliligini tatmak istiyorsaniz kreuzbergi ziyaret edin bu eklektik mahalle farkli bir mutfak ortami son moda butikler ve gelisen bir sanat ortami sunan bir kulturler eritme potasidir yerel halkin piknik ve canli muzik icin bir araya geldigi gorlitzer parki kesfedin veya her koseyi susleyen canli sokak sanati karsisinda buyulenin kreuzberg berliin tarihi gecmisi ile ilerici ve ileri goruslu bugununu kusursuz bir sekilde harmanlama becerisinin bir kanitidir aksamlari berliin efsanevi gece hayatinin tadini cikarabilirsiniz berghain gibi tekno tapinaklarindan samimi caz kuluplerine ve tarihi bira bahcelerine kadar sehir hava karardiktan sonra canlanir kendinizi elektronik muzik sahnesinin titresen ritmine birakin ya da elinizde bir birayla rahat bir barda dinlenin berliin gece hayati herkes icin bir seyler sunar berlin tarih ve modernlik ikilemiyle benzersiz ve zenginlestirici bir seyahat deneyimi vaat ediyor i̇ster sehrin ikonik simgelerinden buyulenmis ister karmasik tarihiyle ilgileniyor ya da modern cazibesiyle buyulenmis olun berlin sizi gecmisini kucaklarken gelecegi kollarini acarak karsilayan bir sehri kesfetmeye davet ediyor '),(620,'field',12,1,' introduction '),(620,'field',12,2,' einfuehrung '),(620,'field',12,11,' はじめに '),(620,'field',12,12,' giris '),(620,'slug',0,1,' exploring berlin a symphony of history and modernity '),(620,'slug',0,2,' berli