(688,'title',0,8,' berlin wall 50727 1280 '),(688,'title',0,9,' berlin wall 50727 1280 '),(688,'title',0,10,' berlin wall 50727 1280 '),(688,'title',0,11,' berlin wall 50727 1280 '),(688,'title',0,12,' berlin wall 50727 1280 '),(688,'title',0,13,' berlin wall 50727 1280 '),(697,'field',10,1,' berliner mauer '),(697,'field',10,2,' berliner mauer '),(697,'field',10,11,' ベルリンの壁 '),(697,'field',10,12,' berlin duvari '),(697,'slug',0,1,''),(697,'slug',0,2,''),(697,'slug',0,11,''),(697,'slug',0,12,''),(698,'field',6,1,' for a taste of the citys modern vibrancy head to kreuzberg this eclectic neighborhood is a melting pot of cultures boasting a diverse culinary scene trendy boutiques and a thriving arts community explore gorlitzer park where locals gather to enjoy picnics and live music or lose yourself in the vibrant street art that adorns every corner kreuzberg is a testament to berlis ability to seamlessly blend its storied past with a progressive forward thinking present in the evening savor berlis legendary nightlife from techno temples like berghain to intimate jazz clubs and historic beer gardens the city comes alive after dark immerse yourself in the pulsating beats of the electronic music scene or unwind in a cozy bar with a craft beer in hand berlis nightlife caters to every taste berlin with its dichotomy of history and modernity promises a unique and enriching travel experience whether youre captivated by its iconic landmarks intrigued by its complex history or enchanted by its contemporary charm berlin invites you to explore a city that has embraced its past while embracing the future with open arms '),(698,'field',6,2,' wenn sie einen vorgeschmack auf die moderne lebendigkeit der stadt haben moechten besuchen sie kreuzberg dieser eklektische bezirk ist ein schmelztiegel der kulturen der eine vielfaeltige kulinarische szene trendige boutiquen und eine bluehende kunstszene zu bieten hat erkunden sie den goerlitzer park wo sich die einheimischen zum picknick und zu live musik treffen oder lassen sie sich von der lebendigen strassenkunst verzaubern die jede ecke ziert kreuzberg ist ein beweis fuer die faehigkeit berlins seine geschichtstraechtige vergangenheit nahtlos mit einer fortschrittlichen zukunftsorientierten gegenwart zu verbinden am abend koennen sie das legendaere berliner nachtleben geniessen von techno tempeln wie dem berghain bis hin zu intimen jazzclubs und historischen biergaerten erwacht die stadt nach einbruch der dunkelheit zum leben tauchen sie ein in die pulsierenden beats der elektronischen musikszene oder entspannen sie sich in einer gemuetlichen bar mit einem craft beer in der hand das berliner nachtleben bietet fuer jeden geschmack etwas berlin mit seiner dichotomie aus geschichte und moderne verspricht eine einzigartige und bereichernde reiseerfahrung ganz gleich ob sie von den ikonischen wahrzeichen der stadt fasziniert sind sich fuer ihre komplexe geschichte interessieren oder sich von ihrem modernen charme verzaubern lassen berlin laedt sie ein eine stadt zu erkunden die sich ihrer vergangenheit stellt und gleichzeitig die zukunft mit offenen armen empfaengt '),(698,'field',6,11,' この街のモダンな活気を味わいたいなら、クロイツベルクを訪れよう。この多彩な文化のるつぼのような地区では、多彩なグルメシーン、トレンディなブティック、盛んなアートシーンが楽しめます。地CNYの人々がピクニックやライブ音楽に集うゲルリッツァー公園を散策したり、いたるところに飾られた鮮やかなストリートアートに魅了されたり。クロイツベルクは、ベルリンの歴史的な過去と進歩的で先進的な現在がシームレスに融合していることを証明しています。 夜には、ベルリンの伝説的なナイトライフを楽しむことができる。ベルクハインのようなテクノの殿堂から、親しみやすいジャズクラブ、歴史あるビアガーデンまで、日が暮れると街は活気づきます。エレクトロニック・ミュージック・シーンの脈打つビートに浸るもよし、居心地のいいバーでクラフトビールを片手にくつろぐもよし、ベルリンのナイトライフは誰もが楽しめるものばかりです。 歴史と現代性の二面性を持つベルリンは、ユニークで豊かな旅行体験をお約束します。ベルリンの象徴的なランドマークに魅了される人も、複雑な歴史に興味を持つ人も、モダンな魅力に魅了される人も、ベルリンは、両手を広げて未来を歓迎しながら、過去を受け入れる都市を探検するようあなたを誘います。 '),(698,'field',6,12,' sehrin modern canliligini tatmak istiyorsaniz kreuzbergi ziyaret edin bu eklektik mahalle farkli bir mutfak ortami son moda butikler ve gelisen bir sanat ortami sunan bir kulturler eritme potasidir yerel halkin piknik ve canli muzik icin bir araya geldigi gorlitzer parki kesfedin veya her koseyi susleyen canli sokak sanati karsisinda buyulenin kreuzberg berliin tarihi gecmisi ile ilerici ve ileri goruslu bugununu kusursuz bir sekilde harmanlama becerisinin bir kanitidir aksamlari berliin efsanevi gece hayatinin tadini cikarabilirsiniz berghain gibi tekno tapinaklarindan samimi caz kuluplerine ve tarihi bira bahcelerine kadar sehir hava karardiktan sonra canlanir kendinizi elektronik muzik sahnesinin titresen ritmine birakin ya da elinizde bir birayla rahat bir barda dinlenin berliin gece hayati herkes icin bir seyler sunar berlin tarih ve modernlik ikilemiyle benzersiz ve zenginlestirici bir seyahat deneyimi vaat ediyor i̇ster sehrin ikonik simgelerinden buyulenmis ister karmasik tarihiyle ilgileniyor ya da modern cazibesiyle buyulenmis olun berlin sizi gecmisini kucaklarken gelecegi kollarini acarak karsilayan bir sehri kesfetmeye davet ediyor '),(698,'slug',0,1,''),(698,'slug',0,2,''),(698,'slug',0,11,''),(698,'slug',0,12,''),(728,'alt',0,1,''),(728,'alt',0,2,''),(728,'alt',0,3,''),(728,'alt',0,4,''),(728,'alt',0,5,''),(728,'alt',0,6,''),(728,'alt',0,7,''),(728,'alt',0,8,''),(728,'alt',0,9,''),(728,'alt',0,10,''),(728,'alt',0,11,''),(728,'alt',0,12,''),(728,'alt',0,13,''),(728,'extension',0,1,' jpg '),(728,'extension',0,2,' jpg '),(728,'extension',0,3,' jpg '),(728,'extension',0,4,' jpg '),(728,'extension',0,5,' jpg '),(728,'extension',0,6,' jpg '),(728,'extension',0,7,' jpg '),(728,'extension',0,8,' jpg '),(728,'extension',0,9,' jpg '),(728,'extension',0,10,' jpg '),(728,'extension',0,11,' jpg '),(728,'extension',0,12,' jpg '),(728,'extension',0,13,' jpg '),(728,'field',5,1,' test '),(728,'field',5,2,' test '),(728,'field',5,3,' test '),(728,'field',5,4,' test '),(728,'field',5,5,' test '),(728,'field',5,6,' test '),(728,'field',5,7,' test '),(728,'field',5,8,' test '),(728,'field',5,9,' test '),(728,'field',5,10,' test '),(728,'field',5,11,' tbd '),(728,'field',5,12,' tbd '),(728,'field',5,13,' tbd '),(728,'filename',0,1,' munich