en des deutschen museums befindet sich ein beeindruckendes planetarium das die besucher zu einer reise durch die sterne einlaedt waehrend der langen nacht werden spezielle shows praesentiert die den nachthimmel ueber muenchen und darueber hinaus erkunden juedisches museum muenchen eine reise durch die kultur und geschichte das juedische museum muenchen widmet sich der aufarbeitung der geschichte und kultur der juedischen gemeinschaft in muenchen waehrend der langen nacht der museen wird das museum zu einem ort der begegnung und des interkulturellen austauschs waehrend der langen nacht werden oft auch temporaere ausstellungen praesentiert die verschiedene aspekte der juedischen kunst geschichte und traditionen beleuchten das juedische museum fungiert nicht nur als ort der ausstellung sondern auch als lebendiges zentrum fuer kulturelle veranstaltungen waehrend der nacht koennen die besucher an vortraegen konzerten und workshops teilnehmen '),(1049,'field',2,8,' munich a city rich in history and culture opens its doors for a fascinating long night of museums among the many outstanding institutions opening their doors on this special evening the deutsches museum and the jewish museum play a prominent role les immerse ourselves in the cultural diversity and captivating experiences offered by these two museums deutsches museum a journey through the history of technology the deutsches museum the worls largest museum of science and technology offers visitors a fascinating journey through the history of technology from steam engines to modern space technologies the exhibition spans several areas the long night of museums allows visitors to immerse themselves in the fascinating world of innovation at the heart of the deutsches museum is an impressive planetarium that invites visitors on a journey through the stars during the long night special shows are presented that explore the night sky over munich and beyond jewish museum munich a journey through culture and history the jewish museum munich is dedicated to exploring the history and culture of the jewish community in munich during the long night of museums the museum becomes a place for encounters and intercultural exchange during the long night temporary exhibitions are often presented that highlight various aspects of jewish art history and traditions the jewish museum functions not only as an exhibition venue but also as a lively center for cultural events during the night visitors can take part in lectures concerts and workshops '),(1049,'field',2,9,' monaco di baviera citta ricca di storia e cultura apre le sue porte per uaffascinante lunga notte dei musei tra le molte istituzioni di spicco che aprono le loro porte in questa serata speciale il deutsches museum e il museo ebraico giocano un ruolo di primo piano immergiamoci nella diversita culturale e nelle esperienze accattivanti offerte da questi due musei deutsches museum un viaggio nella storia della tecnologia il deutsches museum il piu grande museo di scienza e tecnologia del mondo offre ai visitatori un affascinante viaggio nella storia della tecnologia dalle macchine a vapore alle moderne tecnologie spaziali esposizione si estende su diverse aree la lunga notte dei musei permette ai visitatori di immergersi nelaffascinante mondo delinnovazione nel cuore del deutsches museum si trova un imponente planetario che invita i visitatori a fare un viaggio tra le stelle durante la lunga notte vengono presentati spettacoli speciali che esplorano il cielo notturno di monaco e oltre museo ebraico di monaco un viaggio attraverso la cultura e la storia il museo ebraico di monaco e dedicato alanalisi della storia e della cultura della comunita ebraica di monaco durante la lunga notte dei musei il museo diventa un luogo di incontro e di scambio interculturale durante la lunga notte vengono spesso presentate anche mostre temporanee che mettono in luce vari aspetti delarte della storia e delle tradizioni ebraiche il museo ebraico non funziona solo come sede espositiva ma anche come vivace centro di eventi culturali durante la notte i visitatori possono partecipare a conferenze concerti e laboratori '),(1049,'field',2,10,' munchen eine stadt reich an geschichte und kultur offnet ihre turen fur eine faszinierende lange nacht der museen unter den vielen herausragenden institutionen die an diesem besonderen abend ihre pforten offnen nehmen das deutsche museum und das judische museum eine herausragende rolle ein tauchen wir ein in die kulturelle vielfalt und die fesselnden erlebnisse die diese beiden museen bieten deutsches museum eine reise durch die technikgeschichte das deutsche museum das weltweit grosste museum fur wissenschaft und technologie bietet den besuchern eine faszinierende reise durch die geschichte der technik von dampfmaschinen bis zu modernen raumfahrttechnologien erstreckt sich die ausstellung uber mehrere bereiche die lange nacht der museen ermoglicht es den besuchern in die faszinierende welt der innovationen einzutauchen im herzen des deutschen museums befindet sich ein beeindruckendes planetarium das die besucher zu einer reise durch die sterne einladt wahrend der langen nacht werden spezielle shows prasentiert die den nachthimmel uber munchen und daruber hinaus erkunden judisches museum munchen eine reise durch die kultur und geschichte das judische museum munchen widmet sich der aufarbeitung der geschichte und kultur der judischen gemeinschaft in munchen wahrend der langen nacht der museen wird das museum zu einem ort der begegnung und des interkulturellen austauschs wahrend der langen nacht werden oft auch temporare ausstellungen prasentiert die verschiedene aspekte der judischen kunst geschichte und traditionen beleuchten das judische museum fungiert nicht nur als ort der ausstellung sondern auch als lebendiges zentrum fur kulturelle veranstaltungen wahrend der nacht konnen die besucher an vortragen konzerten und workshops teilnehme '),(1049,'field',12,7,' veranstaltungen '),(10